(3, 'Acura', 'Acura, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти Acura Отзывы Акура', 'Acura - автомобиль, производство Америка, покупка продажа запчастей для Acura: CSX , MDX.', '<p style="text-align: left;"><strong>Acura</strong> - <strong>автомобиль</strong>, производство Америка, продажа <strong>автозапчастей</strong>. Для марок:</p>\n<ul>\n<li style="text-align: left;"><strong>CSX</strong></li>\n<li style="text-align: left;"><strong>MDX</strong></li>\n</ul>\n<p style="text-align: left;"><strong>Acura</strong>&nbsp; -&nbsp;Отделение концерна&nbsp;<a href="../index.php?module=catalog&amp;step=2&amp;type=0&amp;marka=22&amp;region=72"><span class="Apple-style-span">Honda</span></a>, которое специализируется на выпуске спортивных и представительских <strong>автомобилей</strong>.&#8203;&nbsp;<strong>Acura</strong> устанавливал новые нормы в автомобильном дизайне и <strong>технике</strong>, усовершенствованный смысл эстетики, и производство точности. Имеет положительные <strong>отзывы</strong> многих сотрудничающих компаний. Имеет полную <strong>техническую</strong> поддержку в <strong>%city%</strong>. Особенно радует новый модельный ряд за <strong>2010-2011</strong> год.&nbsp;</p>'),
(4, 'Alfa Romeo', 'Alfa Romeo, автомобиль,  запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти Alfa Romeo Отзывы Альфа Ромео', 'Alfa Romeo - автомобиль, производство Италии, покупка продажа запчастей для Alfa Romeo: ', '<p><strong>Alfa Romeo</strong> Automobiles S.p.A -&nbsp;&nbsp;итальянская промышленная компания, специализирующаяся на выпуске спортивных <strong>автомобилей </strong>высокого класса и других транспортных средств. Штаб-квартира находится в Милане. Автозапчасти для Alfa Romeo в %city%</p>'),
(5, 'Audi', 'Audi, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти Audi Отзывы Ауди', 'Audi - все автодетали для автомобиля Audi.Любой марки: A3 , A4 , A5 , A6 , A8 , ALLROAD , Q5 , Q7 , S8 , TT .', '<p><strong>Audi </strong>- все<strong> автодетали</strong> для <strong>автомобиля Audi </strong>%town%. Любой марки:</p>\r\n<ul>\r\n<li><strong>A3</strong></li>\r\n<li><strong>A4 </strong></li>\r\n<li><strong>A5 </strong></li>\r\n<li><strong>A6 </strong></li>\r\n<li><strong>A8 </strong></li>\r\n<li><strong>ALLROAD </strong></li>\r\n<li><strong>Q5 </strong></li>\r\n<li><strong>Q7</strong></li>\r\n<li><strong>S8 </strong></li>\r\n<li><strong>TT&nbsp;</strong></li>\r\n</ul>\r\n<p><strong>Автомобили </strong>премиум-класса <strong>Ауди</strong> &mdash; это осуществление более чем сто летнего опыта <strong>технических </strong>инноваций и уникальность дизайна от легендарного автопроизводителя Ауди. Стильные, надежные, со спортивным характером, они получили заслуженные положительные отзывы миллионов автолюбителей во всем мире. Число поклонников марки <strong>Audi в</strong> городе<strong> %town%</strong> растет с каждым годом. <strong>Купить автозапчасть </strong>или сделать <strong>ремонт </strong>автомобиля <strong>Audi </strong>не составляет труда благодаря внедрению <strong>сервисов </strong>по <strong>обслуживанию </strong>в %city%.&#8203;</p>'),
