(8, 'BMW', 'BMW, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти BMW Отзывы БМВ', 'BMW покупка , продажа авто деталей , для любых марок:1-SERIES, 3-SERIES, 5-SERIES , 7-SERIES , X3 , X5 , X6', '<p style="text-align: left;"><strong>BMW</strong>&nbsp;- <strong>автомобиль</strong>, производство Германии. <strong>Покупка</strong> , <strong>продажа автодеталей</strong> , для любых марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>1-SERIES</strong></li>\r\n<li style="text-align: left;"><strong>3-SERIES</strong></li>\r\n<li style="text-align: left;"><strong>5-SERIES</strong></li>\r\n<li style="text-align: left;"><strong>7-SERIES</strong></li>\r\n<li style="text-align: left;"><strong>X3 </strong></li>\r\n<li style="text-align: left;"><strong>X5</strong></li>\r\n<li style="text-align: left;"><strong>X6</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>BMW</strong><a style="text-decoration: none; color: #0645ad; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial;" title="Германия" href="http://ru.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%BC%D0%B0%D0%BD%D0%B8%D1%8F">&nbsp;- </a>уникальный&nbsp;производитель <strong>автомобоилей</strong>, мотоциклов,&nbsp;&nbsp;двигателей.&nbsp;<strong>Цены</strong> на <strong>автомобили BMW</strong> колеблятся от самых доступных моделей до самых <strong>новых</strong> классов,<strong>купить</strong> которые могут единицы. <strong>BMW </strong>всегда радовали своими <strong>техническими </strong>харектеристиками, с его мощными <strong>двигателями</strong>. Любые автозапчасти для BMW в %city%</p>'),
(9, 'BYD', 'BYD, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти BYD Отзывы БУД', 'BYD - автомобиль, производство Китай, покупка продажа запчастей для BYD F3.', '<p style="text-align: left;"><strong>BYD - автомобиль</strong>, производство Китай<strong>. Автозапчасти</strong>, <strong>покупка</strong>, <strong>продажа</strong>, в <strong>%city%</strong>. Для автомобилей</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>BYD F3</strong>.</li>\r\n</ul>\r\n<p style="text-align: left;"><strong>BYD</strong> Auto - китайская компания-производитель <strong>автомобилей</strong>.Основанная в 1995 году, компания <strong>BYD</strong> Limited является высокотехнологичным частным предприятием.Компания <strong>BYD</strong> распологает 9 производственными базами.В данной компании два основных направления бизнеса информационные технологии (IT) и производство <strong>автомобилей</strong>.Благодаря постоянным иновациям в технологиях, исследованиях, разработках и услугах, компания <strong>BYD</strong> завевала доверия многих мировых клиентов.&nbsp;<strong>BYD&nbsp;</strong>имеет абсолютно положительные <strong>отзывы</strong> критиков так и <strong>владельцев</strong>. Особенно радуют <strong>характеристики</strong> <strong>нового</strong>&nbsp;<strong>BYD F3</strong>.&nbsp;</p>'),
(10, 'Bentley', 'Bentley, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти Bentley Отзывы Бентли', 'Bentley покупка , продажа авто деталей , для любых марок. ', '<p><strong>Bentley</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Германии.&nbsp;<strong>Покупка</strong>&nbsp;,&nbsp;<strong>продажа автодеталей</strong>&nbsp;, для любых марок. Все автозапчасти для Bentley в %city%</p>'),
(11, 'Cadillac', 'Cadillac, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти Cadillac Отзывы Кадиллак', 'Cadillac продажа , покупка авто запчастей.Для марок:CTS , ESCALADE , SRX . ', '<p style="text-align: left;"><strong>Cadillac</strong> <strong>продажа</strong> , <strong>покупка</strong> <strong>автозапчастей</strong> в<strong> %city%</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>CTS</strong></li>\r\n<li style="text-align: left;"><strong>ESCALADE</strong></li>\r\n<li style="text-align: left;"><strong>SRX</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>Cadillac</strong> -&nbsp;марка <strong>автомобилей&nbsp;</strong>класса &laquo;люкс&raquo;, принадлежащая General Motors. <strong>Автомобили </strong>&laquo;Кадиллак&raquo; <strong>продаются </strong>более чем в 50 странах и территориях, преимущественно в Северной америке.&nbsp;Компания &laquo;<strong>Кадиллак</strong>&raquo; была образована из остатков компании&nbsp;<a style="text-decoration: none; color: #0645ad; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial;" title="Форд, Генри" href="http://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D1%80%D0%B4,_%D0%93%D0%B5%D0%BD%D1%80%D0%B8">Г</a>енри Форда&nbsp;в&nbsp;<a style="text-decoration: none; color: #0645ad; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial;" title="1902 год" href="http://ru.wikipedia.org/wiki/1902_%D0%B3%D0%BE%D0%B4">1</a>902 году.&nbsp;</p>'),
(12, 'Chery', 'Chery, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти Chery Отзывы Чери', 'Chery покупка, продажа, авто запчастей. Для марок автомобилей:AMULET, FORA, SWEET-QQ, TIGGO.  ', '<p style="text-align: left;"><strong>Chery покупка</strong>, <strong>продажа</strong>, <strong>автозапчастей</strong> в<strong> %city%</strong>. Для марок автомобилей:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>AMULET</strong></li>\r\n<li style="text-align: left;"><strong>FORA</strong></li>\r\n<li style="text-align: left;"><strong>SWEET-QQ</strong></li>\r\n<li style="text-align: left;"><strong>TIGGO</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>Chery -&nbsp;</strong>китайская автомобилестроительная компания.&nbsp;<strong>Chery</strong> начала поставлять свои <strong>автомобили </strong>в Сирию, и стала первым&nbsp;Китайским&nbsp;автоэкспортёром.&nbsp;Сейчас автомобили&nbsp;<strong>Chery</strong> пользуются хорошим успехом на <strong>Российском </strong>рынке,об этом так же говорят <strong>отзывы владельцев</strong>. Показатели <strong>продаж </strong>значительно растут с периода за 2009 <strong>год</strong>. Нельзя не отметить успешное прохождение всех<strong> </strong><strong>краш тестов</strong> новых моделей&nbsp;<strong>Chery.</strong></p>'),
(13, 'Chevrolet', 'Chevrolet, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Запчасти Chevrolet Отзывы Шевроле', 'Chevrolet покупка, продажа, авто запчастей. Для марок автомобилей:AVEO, CAPTIVA , CRUZE, EPICA, LACETTI, LANOS , NIVA, REZZO, SPARK, TAHOE, TRAILBLAZER, VIVA. ', '<p style="text-align: left;"><strong>Chevrolet покупка</strong>, <strong>продажа</strong>, <strong>автозапчастей </strong>в<strong> %city%</strong>. Для марок <strong>автомобилей</strong>:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>AVEO</strong></li>\r\n<li style="text-align: left;"><strong>CAPTIVA</strong></li>\r\n<li style="text-align: left;"><strong>CRUZE</strong></li>\r\n<li style="text-align: left;"><strong>EPICA</strong></li>\r\n<li style="text-align: left;"><strong>LACETTI</strong></li>\r\n<li style="text-align: left;"><strong>LANOS</strong></li>\r\n<li style="text-align: left;"><strong>NIVA</strong></li>\r\n<li style="text-align: left;"><strong>REZZO&nbsp;</strong></li>\r\n<li style="text-align: left;"><strong>SPARK</strong></li>\r\n<li style="text-align: left;"><strong>TAHOE</strong></li>\r\n<li style="text-align: left;"><strong>TRAILBLAZER</strong></li>\r\n<li style="text-align: left;"><strong>VIVA</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>Chevrolet&nbsp;</strong><strong>&#8203;-</strong>&nbsp;марка <strong>автомобилей</strong>, производимых и реализуемых одноимённым экономически самостоятельным подразделением корпорации General Motors.&nbsp;Марка является самой популярной среди марок концерна, в 2007 году&nbsp;было реализовано около 2,6&nbsp;млн автомобилей.&nbsp;Сегодня на рынке России под брендом <strong>Chevrolet продаются </strong>преимущественно <strong>модели </strong>корейского происхождения (<strong>AVEO, CAPTIVA , CRUZE, EPICA, LACETTI, LANOS , NIVA, REZZO, SPARK, TAHOE, TRAILBLAZER, VIVA</strong>), исходно нёсшие бренд Daewoo. Но поскольку &laquo;Daewoo&raquo; ассоциируется в %city% с моделями более низкой <strong>ценовой </strong>группы вроде&nbsp;Матиз и Нексии, это повлекло за собой переименование.</p>'),
(14, 'Chrysler', 'Chrysler, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Chrysler автозапчасти, покупка, продажа', 'Chrysler покупка, продажа, авто запчастей. Для марок автомобилей:VOYAGER.', '<p style="text-align: left;"><strong>Chrysler</strong> <strong>покупка</strong>, <strong>продажа</strong>, <strong>автозапчастей</strong> в<strong> %city%</strong>. Для марок <strong>автомобилей</strong>:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>VOYAGER</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Chrysler </strong>Group LLC&nbsp;(Крайслер) &mdash; американская&nbsp;<strong>автомобильная </strong>компания. В данный момент является совместным концерном с Fiat предприятием.&nbsp;<strong>Chrysler </strong>Grand<strong> Voyager</strong>&nbsp;&mdash;&mdash; <strong>автомобиль</strong>,&nbsp;осуществляемый выпуск компанией&nbsp;<strong>Chrysler</strong>&nbsp;с 1991 года&nbsp;по настоящее время. За все своё время производства <strong>модели </strong>смогло сменится 5 модификаций. </p>'),
(15, 'Citroen', 'Citroen, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Citroen автозапчасти, покупка, продажа', 'Citroen покупка, продажа, авто запчастей. Для марок автомобилей:BERLINGO, C2, C3, C4, C5, CX.', '<p style="text-align: left;"><strong>Citroen покупка</strong>, <strong>продажа</strong>, <strong>автозапчастей </strong>в <strong>%city%</strong>. Для марок <strong>автомобилей</strong>:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>BERLINGO</strong></li>\r\n<li style="text-align: left;"><strong>C2</strong></li>\r\n<li style="text-align: left;"><strong>C3</strong></li>\r\n<li style="text-align: left;"><strong>C4</strong></li>\r\n<li style="text-align: left;"><strong>C5</strong></li>\r\n<li style="text-align: left;"><strong>CX</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Citroen</strong>&nbsp;- французкий&nbsp;производитель <strong>автомобилей</strong>, создана в 1919 году Андре Ситроеном.&nbsp;Была первой в мире <strong>новой </strong>компанией серийного производства автомобилей за пределами США.&nbsp;С 1976<a style="text-decoration: none; color: #0645ad; background-image: none; background-attachment: initial; background-origin: initial; background-clip: initial; background-color: initial; background-position: initial initial; background-repeat: initial initial;" title="1976 год" href="http://ru.wikipedia.org/wiki/1976_%D0%B3%D0%BE%D0%B4">&nbsp;</a>года&nbsp;стал частью концерна по производству автомобилей PSA Peugeot Citroen.&nbsp;На спортивных Citro&euml;n ZX Rallye Raid&nbsp;четырежды одержали победу в самом престижном ралли-рейе Ралли Дакар.&nbsp;<strong>&#8203;</strong><strong>Citroen&nbsp;</strong>получил значительное преимущество и положительные <strong>отзывы </strong>в России благодаря своей <strong>рекламе</strong>.</p>'),
(16, 'Daewoo', 'DAEWOO  автозапчасти , покупка , продажа', 'DAEWOO  автозапчасти , покупка , продажа', 'Daewoo покупка, продажа, авто запчастей. Для марок автомобилей:ESPERO, MATIZ, NEXIA. ', '<p style="text-align: left;"><strong>Daewoo покупка</strong>, <strong>продажа</strong>, <strong>автозапчастей </strong>в<strong> %city%</strong>. Для марок <strong>автомобилей</strong>:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>ESPERO</strong></li>\r\n<li style="text-align: left;"><strong>MATIZ</strong></li>\r\n<li style="text-align: left;"><strong>NEXIA</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong>В настоящий момент, когда <strong>автомобиль</strong> в России не только роскошь, но уже и средство передвижения, невозможно представить ни одну российскую улицу без давно знакомых силуэтов автомобилей&nbsp;<strong>Nexia</strong>&nbsp;и&nbsp;<strong>Matiz</strong>.&nbsp;Один из крупнейших&nbsp;<span class="Apple-style-span">финансово-промышленных групп</span>.&nbsp;Компания была основана&nbsp;<span class="Apple-style-span">22 марта</span>&nbsp;<span class="Apple-style-span">1967 года</span>&nbsp;под названием <strong>Daewoo</strong> Industrial. Компания всегда довольствовалась положительными отзывами, благодаря небольшой <strong>ценой </strong>на автомобили и <strong>запчасти</strong>.</p>'),
(17, 'Dodge', 'Dodge, автомобиль,  запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Dodge автозапчасти , покупка , продажа', 'Dodge покупка, продажа, авто запчастей. Для марок автомобилей:AVENGER, CALIBER. ', '<p style="text-align: left;"><strong>Dodge покупка</strong>, <strong>продажа</strong>, <strong>автозапчастей </strong>в <strong>%city%</strong>. Для марок автомобилей:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>AVENGER</strong></li>\r\n<li style="text-align: left;"><strong>CALIBER</strong></li>\r\n</ul>\r\n<p>&#8203;Одна из самых старейших в истории американского автопрома марка <strong>Dodge </strong>была основана двумя братьями , Джоном и Горацием Додж.&nbsp;Создана компания <strong>Chrysler</strong> Group LLC - &nbsp;стратегический альянс с Fiat Group, в его основе лежит традиционная для <strong>Chrysler </strong>инновации&nbsp;&ndash; начало которой положил Уолтер П. Крайслер &ndash; и современные <strong>технологии </strong>Fiat. Новый альянс обладает ресурсами, <strong>технологиями </strong>и всемирной сетью дилеров и дистрибьюторов &ndash; всем необходимым для успешной конкуренции на мировом рынке. Компания <strong>Chrysler </strong>Group LLC выпускает автомобили и автомобильные компоненты под брендами Chrysler, Jeep, <strong>Dodge</strong>, Mopar&reg; Сегодня <strong>Dodge </strong>- один из наиболее известных &nbsp;и старейших американских брендов - приходит в Россию. Революционный дизайн и динамические <strong>характеристики </strong>этих <strong>моделей </strong>дают полное представление о марке, уже более ста лет создающей автомобили, многие из которых стали настоящей американской легендой. </p>'),
(18, 'Ferrari', 'Ferrari, автомобиль,  запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Ferrari автозапчасти , покупка , продажа', 'Ferrari покупка , продажа авто деталей , для любых марок', '<p><strong>Ferrari</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство .&nbsp;<strong>Покупка</strong>&nbsp;,&nbsp;<strong>продажа автодеталей</strong>&nbsp;, для любых марок:</p>'),
(19, 'Fiat', 'Fiat, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Fiat автозапчасти, покупка, продажа', 'Fiat покупка, продажа, авто запчастей. Для марок автомобилей:ALBEA, DOBLO, PANDA, PUNTO, SIENA. ', '<p style="text-align: left;"><strong>Fiat покупка</strong>, <strong>продажа</strong>, <strong>автозапчастей в %city%</strong><strong></strong>. Для марок <strong>автомобилей</strong>:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>ALBEA</strong></li>\r\n<li style="text-align: left;"><strong>DOBLO</strong></li>\r\n<li style="text-align: left;"><strong>PANDA</strong></li>\r\n<li style="text-align: left;"><strong>PUNTO</strong></li>\r\n<li style="text-align: left;"><strong>SIENA</strong></li>\r\n</ul>\r\n<p style="text-align: left;">Несмотря на свое наследие, <strong>FIAT </strong>сегодня может по праву носить титул &laquo;<strong>Автомобиль </strong>года&raquo;, самым престижный <strong>автомобиль </strong>в мире,&nbsp;<strong>Fiat </strong>был&nbsp;удостоен этой наградой восемь раз.&nbsp;Дело обстоит не в логотипе: сегодня автомобили <strong>FIAT </strong>славятся своим свежим и ярким стилем, своими <strong>техническими характеристиками,</strong> настоящим итальянским дизайном и тем, что они предлагают клиентам более реальные решения. Тем, что &laquo;инновации и эмоции&raquo; всегда были и будут в основе традиции FIAT: с автомобилями <strong>Фиат</strong> мы стараемся создать передовые <strong>технологии </strong>доступными для каждого, предлагая новые умные решения во всех моделях, для того, чтобы сделать жизнь потребителя легче и проще. Так же модельный ряд&nbsp;<strong>FIAT&nbsp;</strong><span style="font-size: 12px;"><span style="font-family: arial,helvetica,sans-serif;">всегда радовал своими ценами Российских потребителей.</span></span></p>'),
(20, 'Ford', 'Ford, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Ford - все автодетали для автомобиля Audi', 'Ford - автомобиль, производство Америка, покупка продажа запчастей для Ford: C-MAX,  ESCAPE,  ESCORT, EXPLORER,  FIESTA,  FOCUS,  FUSION, KA, KUGA,  MAVERICK,  MONDEO,  RANGER,  S-MAX,  TOURNEO, CONNECT,  TRANSIT.', '<p><strong>Ford</strong>&nbsp;- <strong>автомобиль</strong>, производство Америка, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>CSX&nbsp;</strong></li>\r\n<li style="text-align: left;"><strong>MDX</strong></li>\r\n<li style="text-align: left;"><strong>C-MAX </strong></li>\r\n<li style="text-align: left;"><strong>&nbsp;ESCAPE &nbsp;</strong></li>\r\n<li style="text-align: left;"><strong>ESCORT </strong></li>\r\n<li style="text-align: left;"><strong>EXPLORER </strong></li>\r\n<li style="text-align: left;"><strong>&nbsp;FIESTA </strong></li>\r\n<li style="text-align: left;"><strong>&nbsp;FOCUS </strong></li>\r\n<li style="text-align: left;"><strong>&nbsp;FUSION</strong></li>\r\n<li style="text-align: left;"><strong>KA</strong></li>\r\n<li style="text-align: left;"><strong>KUGA &nbsp;</strong></li>\r\n<li style="text-align: left;"><strong>MAVERICK </strong></li>\r\n<li style="text-align: left;"><strong>&nbsp;MONDEO </strong></li>\r\n<li style="text-align: left;"><strong>&nbsp;RANGER &nbsp;</strong></li>\r\n<li style="text-align: left;"><strong>S-MAX &nbsp;</strong></li>\r\n<li style="text-align: left;"><strong>TOURNEO </strong></li>\r\n<li style="text-align: left;"><strong>CONNECT &nbsp;</strong></li>\r\n<li style="text-align: left;"><strong>TRANSIT</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong>Любые<strong> автозапчасти </strong>для<strong> Форд </strong>в<strong> %city%<br /></strong></p>\r\n<p style="text-align: left;">&nbsp;</p>\r\n<p style="text-align: left;"><br /> &nbsp;</p>'),
(21, 'Great Wall', 'Great Wall, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Great Wall - все автодетали для автомобиля Acura', 'Great Wall - автомобиль, производство Китай, покупка продажа запчастей для Great Wall: HOVER', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Great Wall</strong>&nbsp;- <strong>автомобиль</strong>, производство Китай, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul style="padding-right: 40px;">\r\n<li style="text-align: left;"><strong>HOVER</strong></li>\r\n</ul>\r\n<p>Компания&nbsp;<strong>Great Wall</strong>&nbsp;Automobile Holding Co. Ltd., известная как <strong>GreatWall</strong> Motors - крупнейший производитель пикапов и внедорожников в Китае. Кроме пикапов и внедорожников, заводы холдинга производят автобусы, грузовые и легковые <strong>автомобили</strong>. <strong>В России</strong> компания известна прежде всего своими пикапами серии&nbsp;<span class="Apple-style-span"><strong>Great Wall</strong> Deer</span>&nbsp;и внедорожниками&nbsp;&nbsp;<strong><span class="Apple-style-span">Hover</span>. </strong>Любые<strong> автозапчасти </strong>для<strong> </strong><strong>Great Wall </strong>в<strong> %city%</strong></p>'),
(22, 'Honda', 'Honda, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Honda - все автодетали для автомобиля Acura', 'Honda - автомобиль, производство Китай, покупка продажа запчастей для Honda: ACCORD, AVANCIER, CAPA, CIVIC, CR-V, FIT, FR-V, INSPIRE, INTEGRA, JAZZ, LEGEND, LOGO, ODYSSEY, ORTHIA, PARTNER, PILOT, PRELUDE, SABER, SM-X, STEPWGN, STREAM, TORNEO, VIGOR', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Honda</strong>&nbsp;- <strong>автомобиль</strong>, производство Японии, <strong>продажа&nbsp;автозапчастей в %city%</strong>. Для марок:</p>\r\n<ul style="padding-right: 40px;">\r\n<li style="text-align: left;"><strong>ACCORD</strong></li>\r\n<li style="text-align: left;"><strong>AVANCIER</strong></li>\r\n<li style="text-align: left;"><strong>CAPA</strong></li>\r\n<li style="text-align: left;"><strong>CIVIC</strong></li>\r\n<li style="text-align: left;"><strong>CR-V</strong></li>\r\n<li style="text-align: left;"><strong>FIT</strong></li>\r\n<li style="text-align: left;"><strong>FR-V</strong></li>\r\n<li style="text-align: left;"><strong>INSPIRE</strong></li>\r\n<li style="text-align: left;"><strong>INTEGRA</strong></li>\r\n<li style="text-align: left;"><strong>JAZZ</strong></li>\r\n<li style="text-align: left;"><strong>LEGEND</strong></li>\r\n<li style="text-align: left;"><strong>LOGO</strong></li>\r\n<li style="text-align: left;"><strong>ODYSSEY</strong></li>\r\n<li style="text-align: left;"><strong>ORTHIA</strong></li>\r\n<li style="text-align: left;"><strong>PARTNER</strong></li>\r\n<li style="text-align: left;"><strong>PILOT</strong></li>\r\n<li style="text-align: left;"><strong>PRELUDE</strong></li>\r\n<li style="text-align: left;"><strong>SABER</strong></li>\r\n<li style="text-align: left;"><strong>SM-X</strong></li>\r\n<li style="text-align: left;"><strong>STEPWGN</strong></li>\r\n<li style="text-align: left;"><strong>STREAM</strong></li>\r\n<li style="text-align: left;"><strong>TORNEO</strong></li>\r\n<li style="text-align: left;"><strong>VIGOR</strong></li>\r\n</ul>\r\n<p>&nbsp;</p>'),
(23, 'Hummer', 'Hummer, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Hummer - все автодетали для автомобиля Audi', 'Hummer - автомобиль, производство Китай, покупка продажа запчастей для Hummer: H2, H3', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Hummer</strong>&nbsp;- <strong>автомобиль</strong>, производство <strong>США</strong>, продажа&nbsp;<strong>автозапчастей</strong> в %city%. Для марок:</p>\r\n<ul style="padding-right: 40px;">\r\n<li style="text-align: left;"><strong>H2</strong></li>\r\n<li style="text-align: left;"><strong>H3</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>HUMMER</strong> - выпускается Американской компанией, являющаяся частью известного концерна "General Motors", специализируется на выпуске вездеходов большой вместимости. Выпускается Hummer на заводе UAW компании "AM General" в штате Индиана. В %city% часто можно встретить <strong>прокат лимузинов</strong>, очень актуальный в наше время, из-за цены <strong>автомобиля</strong>,&nbsp;&nbsp;его вместительности, специфического <strong>салона</strong>.</p>'),
(24, 'Hyundai', 'Hyundai, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Hyundai - электронный каталог автозапчастей', 'Hyundai - автомобиль, производство Китай, покупка продажа запчастей для Hyundai: ACCENT, COUPE, ELANTRA, GETZ, GRANDEUR, H-1-STAREX, I20, I30, IХ 55, MATRIX, PORTER, SANTA-FE, SONATA, TRAJET, TUCSON, VERNA, X-35', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Hyundai</strong>&nbsp;- <strong>автомобиль</strong>, производство Южной Кореи, <strong>продажа&nbsp;автозапчастей</strong>. Для марок:</p>\r\n<ul style="padding-right: 40px;">\r\n<li style="text-align: left;"><strong>ACCENT</strong></li>\r\n<li style="text-align: left;"><strong>COUPE</strong></li>\r\n<li style="text-align: left;"><strong>ELANTRA</strong></li>\r\n<li style="text-align: left;"><strong>GETZ</strong></li>\r\n<li style="text-align: left;"><strong>GRANDEUR</strong></li>\r\n<li style="text-align: left;"><strong>H-1-STAREX</strong></li>\r\n<li style="text-align: left;"><strong>I20</strong></li>\r\n<li style="text-align: left;"><strong>I30</strong></li>\r\n<li style="text-align: left;"><strong>IХ 55</strong></li>\r\n<li style="text-align: left;"><strong>MATRIX</strong></li>\r\n<li style="text-align: left;"><strong>PORTER</strong></li>\r\n<li style="text-align: left;"><strong>SANTA-FE</strong></li>\r\n<li style="text-align: left;"><strong>SONATA</strong></li>\r\n<li style="text-align: left;"><strong>TRAJET</strong></li>\r\n<li style="text-align: left;"><strong>TUCSON</strong></li>\r\n<li style="text-align: left;"><strong>VERNA</strong></li>\r\n<li style="text-align: left;"><strong>X-35</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>&laquo;Hyundai </strong>Motor Company<strong>&raquo; - &nbsp;</strong><span class="Apple-style-span">южнокорейская</span>&nbsp;автомобилестроительная компания. Крупнейший автопроизводитель в стране и четвёртый в мире. <strong>Конфигурации&nbsp;</strong><strong>Hyundai&nbsp;</strong>радуют&nbsp;потребителей широким выбором возможностей, так можно оценить полный модельный ряд <strong>в %city%</strong>, от <strong>седана </strong>до <strong>хэтчбека</strong>.</p>\r\n<p>&nbsp;</p>'),
(25, 'Infiniti', 'Infiniti, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Infiniti - все автодетали для автомобиля Infiniti', 'Infiniti - автомобиль, производство Японии, покупка продажа запчастей для Infiniti: FX, M35', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Infiniti</strong>&nbsp;- <strong>автомобиль</strong>, производство Японии, <strong>продажа&nbsp;автозапчастей</strong>. Для марок:</p>\r\n<ul style="padding-right: 40px;">\r\n<li style="text-align: left;"><strong>FX</strong></li>\r\n<li style="text-align: left;"><strong>M35</strong></li>\r\n</ul>\r\n<p style="text-align: left;">&#8203;Infiniti - торговая марка автомобилей люкс-класса, принадлежащая японской компании Nissan Motor. Весь модельный ряд <strong>инфинити</strong> создан на базе моделей Nissan. В настоящее время все выпускаемые модели построены на одной платформе &mdash; Nissan FM. Единственная модель, это QX56, созданный на платформе Nissan F-Alpha. <strong>&#8203;Infiniti</strong> это действительно автомобиль люкс-класса, при одном тока взгляде на "золотой" или матовый кузов. И конечно же современные технологии используемые в автомобиле, такие даже как салон из Экокожи говорит о его "современности". Любые <strong>автозапчасти</strong> для <strong>автомобиля Infiniti</strong> в<strong> %city%</strong>.</p>'),
(26, 'Jaguar', 'Jaguar, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Jaguar - все автодетали для автомобиля Jaguar', 'Jaguar - автомобиль, производство Великобритания, покупка продажа запчастей для Jaguar: S-TYPE, XF', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Jaguar</strong>&nbsp;- автомобиль, производство Великобритания, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul style="padding-right: 40px;">\r\n<li style="text-align: left;"><strong>TYPE</strong></li>\r\n<li style="text-align: left;"><strong>XF</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>Jaguar</strong> Cars Ltd. -&nbsp;<span class="Apple-style-span">британская</span>&nbsp;автомобилестроительная компания, специализирующаяся на производстве автомобилей класса &laquo;люкс&raquo;. С&nbsp;<span class="Apple-style-span">2008 года</span>&nbsp;принадлежит индийской компании&nbsp;<span class="Apple-style-span">Tata Motors</span>. Весь <strong>модельный ряд</strong> <strong>Ягуар</strong> без сомнений является классом&nbsp;&laquo;люкс&raquo;.&nbsp;Марка <strong>Jaguar </strong>всегда ассоциировалась с <strong>техническим </strong>совершенством и неотразимым дизайном. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong><strong>Jaguar </strong>в<strong> %city%</strong>.</p>'),
(27, 'Jeep', 'Jeep, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Jeep - все автодетали для автомобиля Jeep', 'Jeep - автомобиль, производство Америка, покупка продажа запчастей для Jeep: COMMANDER, GRAND-CHEROKEE, LIBERTY', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Jeep</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Америка, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>COMMANDER</strong></li>\r\n<li style="text-align: left;"><strong>GRAND-CHEROKEE</strong></li>\r\n<li style="text-align: left;"><strong>LIBERTY</strong></li>\r\n</ul>\r\n<p style="text-align: left;">&#8203;Jeep - марка автомобилей, производимых американской компанией Chrysler. Также нарицательное имя для обозначения <strong>автомобилей</strong> повышенной проходимости. Всеми известный,и уже полюбившийся в<strong> %city%</strong> дизельный Jeep GRAND-CHEROKEE получил новый турбодизель. <strong>Технические характеристики</strong> автомобилей <strong>Jeep</strong> всегда радовали своими инновациями и надежностью. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong><strong>Jeep</strong> в<strong> %city%</strong>.</p>'),
(28, 'Kia', 'Kia, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Kia - все автодетали для автомобиля Kia', 'Kia - автомобиль, производство Америка, покупка продажа запчастей для Kia: CARENS, CEE-D, CERATO, FORTE, MAGENTIS, PICANTO, RIO, SHUMA, SORENTO, SOUL, SPECTRA, SPORTAGE', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Kia</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Южная Корея, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>CARENS</strong></li>\r\n<li style="text-align: left;"><strong>CEE-D</strong></li>\r\n<li style="text-align: left;"><strong>CERATO</strong></li>\r\n<li style="text-align: left;"><strong>FORTE</strong></li>\r\n<li style="text-align: left;"><strong>MAGENTIS</strong></li>\r\n<li style="text-align: left;"><strong>PICANTO</strong></li>\r\n<li style="text-align: left;"><strong>RIO</strong></li>\r\n<li style="text-align: left;"><strong>SHUMA</strong></li>\r\n<li style="text-align: left;"><strong>SORENTO</strong></li>\r\n<li style="text-align: left;"><strong>SOUL</strong></li>\r\n<li style="text-align: left;"><strong>SPECTRA</strong></li>\r\n<li style="text-align: left;"><strong>SPORTAGE</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Kia </strong>Motors Corporation - крупнейшая<span style="font-family: arial,helvetica,sans-serif;"><span style="font-size: 12px;">&nbsp;автомобилестроительная компания Кореи, второй по "статусу" автопроизводитель в&nbsp;<span class="Apple-style-span">Южной Корее</span>, и седьмой в мире. В&nbsp;2010 - <strong>продано </strong>более 2,1 миллионов единиц автомобилей. Модельный ряд&nbsp;</span></span><strong>Kia </strong>весьма разнообразен, от&nbsp;<strong>мотоциклов </strong>до <strong>автобусов</strong>. <strong>Характеритики </strong>автомобилей <strong>Киа</strong> не имеют аналогов на рынке Южной Кореи. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong><strong>&#8203;</strong><strong>Kia </strong>в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>'),
(29, 'Lamborghini', 'Lamborghini, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Lamborghini автозапчасти , покупка , продажа', 'Lamborghini покупка , продажа авто деталей , для любых марок. ', '<p><strong>Lamborghini</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство .&nbsp;<strong>Покупка</strong>&nbsp;,&nbsp;<strong>продажа автодеталей</strong>&nbsp;, для любых марок:</p>'),
(30, 'Land Rover', 'Land Rover, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Land Rover автозапчасти , покупка , продажа', 'Land Rover - автомобиль, производство Великобритания, покупка продажа запчастей для Land Rover: DEFENDER, DISCOVERY, FREELANDER, RANGE-ROVER', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Land Rover</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Великобритания, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>DEFENDER</strong></li>\r\n<li style="text-align: left;"><strong>DISCOVERY</strong></li>\r\n<li style="text-align: left;"><strong>FREELANDER</strong></li>\r\n<li style="text-align: left;"><strong>RANGE-ROVER</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Land Rover</strong>&nbsp; -&nbsp;&nbsp;<span class="Apple-style-span">британская</span>&nbsp;автомобилестроительная компания, специализирующаяся на производстве <strong>автомобилей </strong>повышенной проходимости класса &laquo;премиум&raquo;. С&nbsp;<span class="Apple-style-span">2008 года</span>&nbsp;принадлежит индийской компании&nbsp;<span class="Apple-style-span">Tata Motors</span>. Входит в состав группы&nbsp;<span class="Apple-style-span">Jaguar Land Rover</span>. Имеет свои клубы автопользователей&nbsp;<strong>Land Rover&nbsp;</strong><strong>DISCOVERY&nbsp;</strong>и многие другие. Внедорожники <strong>Ланд Ровер </strong>пользуются не только успехом в Британии но и <strong>в %city%</strong>, благодоря своим незаменимым <strong>техническим характеристикам</strong>, и <strong>отзывам </strong>профессиональных автогонщиков.</p>');
