(31, 'Lexus', 'Lexus, автомобиль,  запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Lexus автозапчасти , покупка , продажа', 'Lexus - автомобиль, производство Япония, покупка продажа запчастей для Lexus: GS, IS, LS, LX, RX, SC.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Lexus</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Япония, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>GS</strong></li>\r\n<li style="text-align: left;"><strong>IS</strong></li>\r\n<li style="text-align: left;"><strong>LS</strong></li>\r\n<li style="text-align: left;"><strong>LX</strong></li>\r\n<li style="text-align: left;"><strong>RX</strong></li>\r\n<li style="text-align: left;"><strong>SC</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Lexus </strong>- марка автомобилей класса &laquo;премиум&raquo;, производимых японской корпорацией Toyota. Весь модельный ряд <strong>Лексус</strong> это пристижные автомобили, его концепт-кары восхищают все больше и больше.В Новом модельном ряде <strong>Lexus</strong> можно увидеть иновационные технические <strong>характеристики</strong>, так от уникальной пневмоподвески до электроники последнего поколения. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong>Lexus в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>'),
(32, 'Lincoln', 'Lincoln, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Lincoln автозапчасти , покупка , продажа', 'Lincoln покупка , продажа авто деталей , для любых марок', '<p><strong>Lincoln</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Германии.&nbsp;<strong>Покупка</strong>&nbsp;,&nbsp;<strong>продажа автодеталей</strong>&nbsp;, для любых марок:</p>'),
(33, 'Maybach', 'Maybach, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Maybach автозапчасти , покупка , продажа', 'Maybach покупка , продажа авто деталей , для любых марок: В России. ', '<p><strong>Maybach</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Германии.&nbsp;<strong>Покупка</strong>&nbsp;,&nbsp;<strong>продажа автодеталей</strong>&nbsp;, для любых марок:</p>'),
(34, 'Mazda', 'Mazda, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Mazda автозапчасти , покупка , продажа', 'Mazda - автомобиль, производство Япония, покупка продажа запчастей для Mazda: 2, 3, 323, 5, 6, 626, BONGO, BT-50, CAPELLA, CX-7, CX-9, DEMIO, FAMILIA, MPV, PREMACY, TRIBUTE.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Mazda</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Япония, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>2</strong></li>\r\n<li style="text-align: left;"><strong>3</strong></li>\r\n<li style="text-align: left;"><strong>323</strong></li>\r\n<li style="text-align: left;"><strong>5</strong></li>\r\n<li style="text-align: left;"><strong>6</strong></li>\r\n<li style="text-align: left;"><strong>626</strong></li>\r\n<li style="text-align: left;"><strong>BONGO</strong></li>\r\n<li style="text-align: left;"><strong>BT-50</strong></li>\r\n<li style="text-align: left;"><strong>CAPELLA</strong></li>\r\n<li style="text-align: left;"><strong>CX-7</strong></li>\r\n<li style="text-align: left;"><strong>CX-9</strong></li>\r\n<li style="text-align: left;"><strong>DEMIO</strong></li>\r\n<li style="text-align: left;"><strong>FAMILIA</strong></li>\r\n<li style="text-align: left;"><strong>MPV</strong></li>\r\n<li style="text-align: left;"><strong>PREMACY</strong></li>\r\n<li style="text-align: left;"><strong>TRIBUTE</strong></li>\r\n</ul>'),
(35, 'Mercedes-Benz', 'Mercedes-Benz, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Mercedes-Benz автозапчасти , покупка , продажа', 'Mercedes-Benz - автомобиль, производство Германии, покупка продажа запчастей для Mercedes-Benz: A-KLASSE, B-KLASSE, C-KLASSE, CL-KLASSE, CLK-KLASSE, E-KLASSE, G-KLASSE, GL-KLASSE, GLK-KLASSE, M-KLASSE, R-KLASSE, S-KLASSE, SLK-KLASSE, VITO, МL.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Mercedes-Benz</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Германии, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>A-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>B-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>C-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>CL-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>CLK-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>E-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>G-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>GL-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>GLK-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>M-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>R-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>S-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>SLK-KLASSE</strong></li>\r\n<li style="text-align: left;"><strong>VITO</strong></li>\r\n<li style="text-align: left;"><strong>МL</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Mercedes-Benz -</strong>&nbsp;компания выпускает&nbsp;<strong>легковые автомобили </strong>премиум-класса, грузовые <strong>автомобили</strong>,&nbsp;<span class="Apple-style-span">автобусы</span>&nbsp;и другие транспортных средства. На данный момент является дочерней компанией концерна &laquo;Даймлер АГ&raquo;. Штаб-квартира находится в&nbsp;<span class="Apple-style-span">Штутгарте</span>. Образована в&nbsp;<span class="Apple-style-span">1871 году</span>. В&nbsp;<span class="Apple-style-span">2010 году</span>&nbsp;<span class="Apple-style-span">бренд</span>&nbsp;удерживает второе место по цене компаний - производителей <strong>автомобилей</strong>. Модельный ряд&nbsp;<strong>&#8203;</strong><strong>Mercedes</strong>&nbsp;покарил весь мир, от старых, ставших легедой, до новых классов неимеющих аналогов в мире. Любые <strong>автозапчасти</strong> для <strong>автомобиля Мерседес </strong>в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>'),
(36, 'Mitsubishi', 'Mitsubishi, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Mitsubishi автозапчасти , покупка , продажа', 'Mitsubishi - автомобиль, производство Япония, покупка продажа запчастей для Mitsubishi: ASX, CARISMA, CHARIOT, COLT, DELICA, DIAMANTE, DINGO, DION, GALANT, GRANDIS, L 200, L 300, LANCER, LANCER 10, LANCER 9, LEGNUM, LIBERO, MIRAGE, OUTLANDER, OUTLANDER XL, PAJERO, PAJERO 3, PAJERO 4, PAJERO PININ, PAJERO SPORT, RVR, SPACE-STAR.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Mitsubishi</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Япония, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>ASX</strong></li>\r\n<li style="text-align: left;"><strong>CARISMA</strong></li>\r\n<li style="text-align: left;"><strong>CHARIOT</strong></li>\r\n<li style="text-align: left;"><strong>COLT</strong></li>\r\n<li style="text-align: left;"><strong>DELICA</strong></li>\r\n<li style="text-align: left;"><strong>DIAMANTE</strong></li>\r\n<li style="text-align: left;"><strong>DINGO</strong></li>\r\n<li style="text-align: left;"><strong>DION</strong></li>\r\n<li style="text-align: left;"><strong>GALANT</strong></li>\r\n<li style="text-align: left;"><strong>GRANDIS</strong></li>\r\n<li style="text-align: left;"><strong>L 200</strong></li>\r\n<li style="text-align: left;"><strong>L 300</strong></li>\r\n<li style="text-align: left;"><strong>LANCER</strong></li>\r\n<li style="text-align: left;"><strong>LANCER 10</strong></li>\r\n<li style="text-align: left;"><strong>LANCER 9</strong></li>\r\n<li style="text-align: left;"><strong>LEGNUM</strong></li>\r\n<li style="text-align: left;"><strong>LIBERO</strong></li>\r\n<li style="text-align: left;"><strong>MIRAGE</strong></li>\r\n<li style="text-align: left;"><strong>OUTLANDER</strong></li>\r\n<li style="text-align: left;"><strong>OUTLANDER XL</strong></li>\r\n<li style="text-align: left;"><strong>PAJERO</strong></li>\r\n<li style="text-align: left;"><strong>PAJERO 3</strong></li>\r\n<li style="text-align: left;"><strong>PAJERO 4</strong></li>\r\n<li style="text-align: left;"><strong>PAJERO PININ</strong></li>\r\n<li style="text-align: left;"><strong>PAJERO SPORT</strong></li>\r\n<li style="text-align: left;"><strong>RVR</strong></li>\r\n<li style="text-align: left;"><strong>SPACE-STAR</strong></li>\r\n</ul>\r\n<p><strong>Mitsubishi Group -</strong>&nbsp;всемирно известная японская группа компаний. Штаб-квартира&nbsp;- в&nbsp;<span class="Apple-style-span">Токио</span>.&nbsp;Компанию <strong>Mitsubishi </strong>основал в начале 1870-х годов. Ещё в начале XX века <strong>Mitsubishi </strong>превратилась в огромную компанию, которая до окончания&nbsp;<span class="Apple-style-span">Второй мировой войны</span>&nbsp;принадлежала одной семье. В <strong>сравнении </strong>со своими соотечественниками, компания <strong>Митцубиши</strong> выбилась на международный рынок гораздо быстрее, благодоря своим <strong>техническим характеристикам.</strong>. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong>Mitsubishi в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>'),
(37, 'Nissan', 'Nissan, запчасти, автозапчастей, продажа, ниссан, отзывы', 'Запчасти Nissan Отзывы Ниссан', 'Nissan, Ниссан - автомобиль, производство Япония, покупка продажа запчастей для марок: AD, ALMERA, AVENIR, BLUEBIRD, CEFIRO, CUBE, ELGRAND, LAUREL, LIBERTY, MARCH, MAXIMA, MICRA, MURANO, NAVARA, NOTE, PATHFINDER, PATROL, PRIMERA, PULSAR, QASHQAI, R-NESSA, SERENA, SKYLINE, SUNNY, TEANA, TERRANO, TIIDA, WINGROAD, X-TRAIL', '<p style="text-align: left;">&nbsp;<strong>Nissan</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Япония, продажа&nbsp;<strong>автозапчастей </strong>в городе<strong> %town%. </strong>Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>AD</strong></li>\r\n<li style="text-align: left;"><strong>ALMERA</strong></li>\r\n<li style="text-align: left;"><strong>AVENIR</strong></li>\r\n<li style="text-align: left;"><strong>BLUEBIRD</strong></li>\r\n<li style="text-align: left;"><strong>CEFIRO</strong></li>\r\n<li style="text-align: left;"><strong>CUBE</strong></li>\r\n<li style="text-align: left;"><strong>ELGRAND</strong></li>\r\n<li style="text-align: left;"><strong>LAUREL</strong></li>\r\n<li style="text-align: left;"><strong>LIBERTY</strong></li>\r\n<li style="text-align: left;"><strong>MARCH</strong></li>\r\n<li style="text-align: left;"><strong>MAXIMA</strong></li>\r\n<li style="text-align: left;"><strong>MICRA</strong></li>\r\n<li style="text-align: left;"><strong>MURANO</strong></li>\r\n<li style="text-align: left;"><strong>NAVARA</strong></li>\r\n<li style="text-align: left;"><strong>NOTE</strong></li>\r\n<li style="text-align: left;"><strong>PATHFINDER</strong></li>\r\n<li style="text-align: left;"><strong>PATROL</strong></li>\r\n<li style="text-align: left;"><strong>PRIMERA</strong></li>\r\n<li style="text-align: left;"><strong>PULSAR</strong></li>\r\n<li style="text-align: left;"><strong>QASHQAI</strong></li>\r\n<li style="text-align: left;"><strong>R-NESSA</strong></li>\r\n<li style="text-align: left;"><strong>SERENA</strong></li>\r\n<li style="text-align: left;"><strong>SKYLINE</strong></li>\r\n<li style="text-align: left;"><strong>SUNNY</strong></li>\r\n<li style="text-align: left;"><strong>TEANA</strong></li>\r\n<li style="text-align: left;"><strong>TERRANO</strong></li>\r\n<li style="text-align: left;"><strong>TIIDA</strong></li>\r\n<li style="text-align: left;"><strong>WINGROAD</strong></li>\r\n<li style="text-align: left;"><strong>X-TRAIL</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;Nissan&nbsp;</strong> - японский автопроизводитель, один из крупнейших в мире. Компания основана в 1933 году. На 2010 год, автопроизводитель <strong>Ниссан</strong> занимает восьмое место в мировом рейтинге автопроизводителей (Третье среди японских производителей, после Toyota и Honda). Уровень <strong>автомобилей</strong> можно увидеть по технической характеристике его каждой модели. Компания <strong>&#8203;Nissan</strong> занимается так же производством двигателей, тюнинг и доработка автомобилей, и многим другим. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong>&#8203;Nissan в<strong> %city%</strong>. </p>'),
(38, 'Opel', 'Opel, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Opel автозапчасти , покупка , продажа', 'Opel - автомобиль, производство Германия, покупка продажа запчастей для Opel: ANTARA, ASTRA, CORSA, INSIGNIA, MERIVA, VECTRA, ZAFIRA', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Opel</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Германия, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>ANTARA</strong></li>\r\n<li style="text-align: left;"><strong>ASTRA</strong></li>\r\n<li style="text-align: left;"><strong>CORSA</strong></li>\r\n<li style="text-align: left;"><strong>INSIGNIA</strong></li>\r\n<li style="text-align: left;"><strong>MERIVA</strong></li>\r\n<li style="text-align: left;"><strong>VECTRA</strong></li>\r\n<li style="text-align: left;"><strong>ZAFIRA</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Opel -</strong>&nbsp;&nbsp;производитель&nbsp;<strong><span class="Apple-style-span">автомобилей&nbsp;</span></strong><span class="Apple-style-span">Германии</span>, входящих в концерн&nbsp;<span class="Apple-style-span">General Motors</span>. Штаб-квартира расположена в&nbsp;<span class="Apple-style-span">Рюссельсхайме</span>,&nbsp;<span class="Apple-style-span">Германия</span>. Компания была основана&nbsp;<span class="Apple-style-span">двадцать первого января</span>&nbsp;<span class="Apple-style-span">1863 года</span>&nbsp;и приступила к выпуску <strong>автомобилей </strong>в&nbsp;<span class="Apple-style-span">1899 году</span>.&nbsp;<strong>Opel</strong>&nbsp;предлагает большой выбор бензиновых и <strong>дизельных двигателей </strong>с низким уровнем выхлопных газов. Любые <strong>автозапчасти</strong> для <strong>автомобиля Опель </strong>в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>'),
(39, 'Peugeot', 'Peugeot, автомобиль,  запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Peugeot автозапчасти , покупка , продажа', 'Peugeot - автомобиль, производство Франция, покупка продажа запчастей для Peugeot: 1007, 206, 207, 307, 308, 407, 607, PARTNER', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Peugeot</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Франция, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>1007</strong></li>\r\n<li style="text-align: left;"><strong>206</strong></li>\r\n<li style="text-align: left;"><strong>207</strong></li>\r\n<li style="text-align: left;"><strong>307</strong></li>\r\n<li style="text-align: left;"><strong>308</strong></li>\r\n<li style="text-align: left;"><strong>407</strong></li>\r\n<li style="text-align: left;"><strong>607</strong></li>\r\n<li style="text-align: left;"><strong>PARTNER</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;Peugeot</strong> - основной производитель автомобилей во Франции, часть PSA <strong>Peugeot</strong> Citro&euml;n. Компания PSA <strong>Peugeot</strong> Citro&euml;n является вторым крупнейшим автопроизводителем по величине в Европе, после Volkswagen и лидер в производстве автомобилей с низким уровнем выхлопа. Двигатель <strong>Пежо</strong> сконструирован так, что расход топлива свиден на минимум. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong>&#8203;Peugeot в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>\r\n<p style="text-align: left;">&nbsp;</p>'),
(40, 'Porsche', 'Porsche, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Porsche автозапчасти , покупка , продажа', 'Porsche - автомобиль, производство Германия, покупка продажа запчастей для Porsche: CAYENNE.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Porsche</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Германия, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>CAYENNE</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Porsche -&nbsp;</strong>автомобилестроительный концерн Германии, основанный немецким конструктором&nbsp;<span class="Apple-style-span">Фердинандом Порше</span>&nbsp;в&nbsp;<span class="Apple-style-span">1931 году</span>.&nbsp;<span class="Apple-style-span">Штаб-квартира</span>&nbsp;и&nbsp;<span class="Apple-style-span">мануфактура</span>&nbsp;находится в&nbsp;<span class="Apple-style-span">Штутгарте</span>,&nbsp;<span class="Apple-style-span">Германия</span>. Основным акционером компании&nbsp;является&nbsp;<span class="Apple-style-span">род Порше</span>. <strong>Порше </strong>самый высокодоходной <strong>автомобильный </strong>концерн в мире.&nbsp;На доске рейтинга&nbsp;<em style="font-weight: bold; font-style: normal;">самых надежных автомобилей</em>&nbsp;2010 года, марка&nbsp;<em style="font-weight: bold; font-style: normal;">Porsche&nbsp;</em>заняла почетное первое место. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong>&#8203;Porsche в<strong> %city%</strong>.</p>'),
(41, 'Renault', 'Renault, Рено, запчасти, автозапчастей, каталог,', 'Запчасти Renault', 'Renault - автомобиль, производство Франция, покупка продажа запчасти для Рено: 19, CLIO, FLUENCE, KANGOO, KOLEOS, LAGUNA, LOGAN, MEGANE, SANDERO, SCENIC, SYMBOL. Отзывы Рено', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Renault</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Франция, продажа, каталог <strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>19</strong></li>\r\n<li style="text-align: left;"><strong>CLIO</strong></li>\r\n<li style="text-align: left;"><strong>FLUENCE</strong></li>\r\n<li style="text-align: left;"><strong>KANGOO</strong></li>\r\n<li style="text-align: left;"><strong>KOLEOS</strong></li>\r\n<li style="text-align: left;"><strong>LAGUNA</strong></li>\r\n<li style="text-align: left;"><strong>LOGAN</strong></li>\r\n<li style="text-align: left;"><strong>MEGANE</strong></li>\r\n<li style="text-align: left;"><strong>SANDERO</strong></li>\r\n<li style="text-align: left;"><strong>SCENIC</strong></li>\r\n<li style="text-align: left;"><strong>SYMBOL</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Renault -</strong>&nbsp;французская&nbsp;<span class="Apple-style-span">автомобилестроительная корпорация</span>.&nbsp;Новые модели&nbsp;Renault&nbsp;не перестают нас удивлять своими технологиями и своим <strong>сервисом&nbsp;</strong>обслуживания <strong>в %city%</strong>. На&nbsp;протяжении более столетней истории компании, <strong>Рено</strong> стремилась внедрить&nbsp;<strong>автомобиль </strong>в массы, сделать его более комфортным и&nbsp;<strong>безопасным</strong>, используя в производстве передовые технологии и&nbsp;инновации. Любые <strong>запчасти</strong> <strong>Renault</strong> в городе %town%.</p>'),
(42, 'Rover', 'Rover, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Rover автозапчасти , покупка , продажа', 'Rover покупка , продажа авто деталей , для любых марок: В России. ', '<p><strong>Rover</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Германии.&nbsp;<strong>Покупка</strong>&nbsp;,&nbsp;<strong>продажа автодеталей</strong>&nbsp;, для любых марок:</p>'),
(43, 'SEAT', 'SEAT, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'SEAT автозапчасти , покупка , продажа', 'SEAT покупка , продажа авто деталей , для любых марок.', '<p><strong>BMW</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство .&nbsp;<strong>Покупка</strong>&nbsp;,&nbsp;<strong>продажа автодеталей</strong>&nbsp;, для любых марок:</p>'),
(44, 'Saab', 'Saab, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Saab автозапчасти , покупка , продажа', 'Saab - автомобиль, производство Швеция, покупка продажа запчастей для Saab: 9000.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Saab</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Швеция, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>9000</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong><strong>Saab </strong></strong>Automobile AB<strong>&nbsp;-&nbsp;</strong>Шведская автомобилестроительная компания. Производитель&nbsp;<span class="Apple-style-span">легковых <strong>автомобилей&nbsp;</strong></span>под маркой <strong>SAAB</strong>.&nbsp;В конце сороковых годов специалисты фирмы спроектировали свою первую модель&nbsp;<strong><strong>Saab</strong></strong>-92. Одной из самых удачных моделей компании&nbsp;<strong>Saab&nbsp;</strong>стал универсал <strong>Saab </strong>95,вышедший с конвеера в 1959 году. С этого момента начался громкий коммерческий успех <strong>SAAB</strong>.</p>\r\n<p>&nbsp;</p>'),
(45, 'Skoda', 'Skoda, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Skoda автозапчасти , покупка , продажа', 'Skoda - автомобиль, производство Чехия, покупка продажа запчастей для Skoda: FABIA, OCTAVIA, ROOMSTER, SUPERB, YETI.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>S</strong><strong>koda</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Чехия, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>FABIA</strong></li>\r\n<li style="text-align: left;"><strong>OCTAVIA</strong></li>\r\n<li style="text-align: left;"><strong>ROOMSTER</strong></li>\r\n<li style="text-align: left;"><strong>SUPERB</strong></li>\r\n<li style="text-align: left;"><strong>YETI</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;Skoda</strong> Auto - автомобилестроительная компания Чехии, входящая в Volkswagen Group(VAG) вместе они выпускают легковые автомобили, под маркой Skoda. В данное время, компания <strong>Шкода</strong> не считая легковые автомобили выпускает грузовики, автобусы, авиационные двигатели и сельскохозяйственные машины. История автомобилестроительной компании <strong>Skoda</strong> началась с велосипедов. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong>Skoda в<strong> %city%</strong>.</p>'),
(46, 'SsangYong', 'SsangYong, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'SsangYong автозапчасти , покупка , продажа', 'SsangYong - автомобиль, производство Америка, покупка продажа запчастей для SsangYong: ACTYON, KYRON, REXTON.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>SsangYong</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, <strong>Страна производитель</strong> Корея, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>ACTYON</strong></li>\r\n<li style="text-align: left;"><strong>KYRON</strong></li>\r\n<li style="text-align: left;"><strong>REXTON</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>SsangYong </strong>Motor Company&nbsp;-&nbsp;<span class="Apple-style-span">Корейская&nbsp;</span>машиностроительная компания, производитель&nbsp;<span class="Apple-style-span">легковых <strong>автомобилей</strong></span>.&nbsp;<strong>SsangYong</strong> Motor Company - признанный специалист по созданию <strong>полноприводных </strong>автомобилей класса &laquo;премиум&raquo;. Многолетний опыт и новейшие технологии компании нашли свое воплощение в высококачественных продуктах, отвечающих запросам самых взыскательных потребителей по всему миру.</p>'),
(47, 'Subaru', 'Subaru, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Subaru автозапчасти , покупка , продажа', 'Subaru продажа , покупка авто запчастей в России.Для марок: B9-TRIBECA, FORESTER, IMPREZA, LEGACY, OUTBACK. ', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Subaru</strong>&nbsp;<strong>продажа</strong>&nbsp;,&nbsp;<strong>покупка</strong>&nbsp;<strong>автозапчастей</strong>&nbsp;в<strong> %city%</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>B9-TRIBECA</strong></li>\r\n<li style="text-align: left;"><strong>FORESTER</strong></li>\r\n<li style="text-align: left;"><strong>IMPREZA</strong></li>\r\n<li style="text-align: left;"><strong>LEGACY</strong></li>\r\n<li style="text-align: left;"><strong>OUTBACK</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>Subaru -</strong>&nbsp;марка <strong>автомобилей</strong>, бренд японской компании&nbsp;<span class="Apple-style-span">Fuji Heavy Industries</span>. Страна производитель - Япония. Самамя известная и распространенная&nbsp;модель это&nbsp;<strong>Subaru</strong>&nbsp;<strong>IMPREZA.&nbsp;</strong>Благодоря своим <strong>техническим характеристикам</strong> этот <strong>автомобиль </strong>стал номер один для многих автоманов и не только. Просмотрев&nbsp;<strong>тест-драйв</strong> этого автомобиля, можно сразу сказать о уровне этой марки. Блогадоря своей уникальности автомобилей <strong>Субару,&nbsp;</strong>&nbsp;<strong>техническое обслуживание</strong> производится исключительно в их специализированных центрах.</p>'),
(48, 'Suzuki', 'Suzuki, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Suzuki автозапчасти , покупка , продажа', 'Suzuki продажа , покупка авто запчастей. Для марок: AERIO, CULTUS-WAGON, GRAND-VITARA, JIMNY, LIANA, SWIFT, SX4', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Suzuki&nbsp;</strong><strong>продажа</strong>&nbsp;,&nbsp;<strong>покупка</strong>&nbsp;<strong>автозапчастей</strong>&nbsp;в<strong> %city%</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>AERIO</strong></li>\r\n<li style="text-align: left;"><strong>CULTUS-WAGON</strong></li>\r\n<li style="text-align: left;"><strong>GRAND-VITARA</strong></li>\r\n<li style="text-align: left;"><strong>JIMNY</strong></li>\r\n<li style="text-align: left;"><strong>LIANA</strong></li>\r\n<li style="text-align: left;"><strong>SWIFT</strong></li>\r\n<li style="text-align: left;"><strong>SX4</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Suzuki </strong>Motor Corporation -&nbsp;<span class="Apple-style-span">Японская</span>&nbsp;машиностроительная компания. <strong>Автоцентры&nbsp;</strong><strong>Suzuki&nbsp;</strong>сейчас расположены во всех крупнейших городах. Так же имеется <strong>клуб </strong>автолюбителей <strong>Сузуки. </strong>Изначально компания производила мотоциклы и мопеды. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong><strong>&#8203;</strong>Suzuki в<strong> %city%</strong>.</p>'),
(49, 'Toyota', 'Toyota, Тойота, запчасти, автозапчастей, каталог', 'Запчасти Toyota Отзывы Тойота', 'Toyota автозапчастей. Для марок ALLEX, ALTEZZA, ARISTO, AURIS, AVENSIS, CALDINA, CAMRY, CARIB, CARINA, CELICA, CHASER, COROLLA, COROLLA 100, COROLLA 120, COROLLA 150, COROLLA VERSO, CORONA, CORSA, CRESTA, CROWN, CYNOS, DUET, ECHO, ESTIMA, FILDER, FUNCARGO, GAIA, GRAND-HIACE, HARRIER, HIACE, HILUX, IPSUM, IST, LAND CRUISER 100, LAND CRUISER 120, LAND CRUISER 200, LAND CRUISER PRADO, MARK-II, MARK-X, OPA, PASSO, PLATZ, PRIUS, RAUM, RAV-4, SCEPTER, SOARER, SPRINTER, STARLET, SUCCEED, SUPRA, TUNDRA, VISTA, VITZ, VOLTZ, WINDOM, WISH, YARIS, Отзывы тойота', '<p><strong>Toyota</strong>&nbsp;<strong>продажа</strong>&nbsp;,&nbsp;<strong>покупка</strong>&nbsp;<strong>автозапчастей</strong>&nbsp;в городе <strong>%city%</strong>. Для марок всех известных моделей:<strong> COROLLA,</strong><strong>LAND CRUISER</strong><strong>, MARK</strong><strong>, RAV-4 </strong>и др.<strong><br /></strong></p>\r\n<p><strong>Toyota</strong>&nbsp;&mdash; крупнейшая&nbsp;автомобилестроительная корпорация Японии, также компания <strong>Тойота</strong> предоставляет финансовые услуги и имеет другие направления в бизнесе. Тайота это прежде всего престиж, в <strong>комплектации </strong>автомобилей&nbsp;Toyota&nbsp;&nbsp;входит все необходимое, что может понадобиться автовладельцу.&nbsp;Серия&nbsp;<span class="Apple-style-span">4-цилиндровых рядных</span>&nbsp;двигателей&nbsp;S&nbsp;появилась в&nbsp;<span class="Apple-style-span">1982</span>&nbsp;году и одновременно с двигателями серии&nbsp;А, в течение долгого времени являлась основной в производственной программе концерна&nbsp;<strong><span class="Apple-style-span">Toyota</span></strong>.&nbsp;</p>\r\n<p>Единый <strong>каталог автозапчастей</strong> для Вашего автомобиля, покупка, продажа б/у деталей. <strong>Отзывы о автомобиле Тойота</strong>. Проект <strong>АвтоДеталь</strong> объединяет в себе удобство и эконимию времени. Здесь вы можете <strong>купить, продать</strong> необходимые вам <strong>запчасти</strong>. Поиск запчастей для Вашей иномарки Toyota.</p>'),
(50, 'Volkswagen', 'Volkswagen, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Volkswagen автозапчасти , покупка , продажа', 'Volkswagen покупка, продажа, авто запчастей в России. Для марок автомобилей: BORA, CADDY, GOLF, GOLF 4, GOLF 5, GOLF 6, JETTA, MULTIVAN, PASSAT, POINTER, POLO, TIGUAN, TOUAREG, TOURAN, TRANSPORTER.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Volkswagen&nbsp;покупка</strong>,&nbsp;<strong>продажа</strong>,&nbsp;<strong>автозапчастей </strong>в %city%. Для марок&nbsp;<strong>автомобилей</strong>:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>BORA</strong></li>\r\n<li style="text-align: left;"><strong>CADDY</strong></li>\r\n<li style="text-align: left;"><strong>GOLF</strong></li>\r\n<li style="text-align: left;"><strong>GOLF 4</strong></li>\r\n<li style="text-align: left;"><strong>GOLF 5</strong></li>\r\n<li style="text-align: left;"><strong>GOLF 6</strong></li>\r\n<li style="text-align: left;"><strong>JETTA</strong></li>\r\n<li style="text-align: left;"><strong>MULTIVAN</strong></li>\r\n<li style="text-align: left;"><strong>PASSAT</strong></li>\r\n<li style="text-align: left;"><strong>POINTER</strong></li>\r\n<li style="text-align: left;"><strong>POLO</strong></li>\r\n<li style="text-align: left;"><strong>TIGUAN</strong></li>\r\n<li style="text-align: left;"><strong>TOUAREG</strong></li>\r\n<li style="text-align: left;"><strong>TOURAN</strong></li>\r\n<li style="text-align: left;"><strong>TRANSPORTER</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Volkswagen </strong>AG (VAG)&nbsp; -&nbsp;автомобилестроительный концерн Германии, по итогам девятого месяцев 2009 года крупнейший в мире производитель автомобилей. <strong>Volkswagen </strong>Group владеет 20&nbsp;% акций компании&nbsp;<span class="Apple-style-span">MAN AG</span>&nbsp;- известного производителя &nbsp;<strong>грузовиков</strong>, <strong>автобусов</strong>, <strong>дизельных </strong>и гибридных <strong>двигателей</strong>. Любые <strong>автозапчасти</strong> для <strong>автомобиля Фольцваген </strong>в<strong> %city%</strong>.</p>'),
(51, 'Volvo', 'Volvo, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Volvo автозапчасти , покупка , продажа', 'Volvo покупка, продажа, авто запчастей в России. Для марок автомобилей: C30, S40, S60, S80, V50, XC60, XC70, XC90.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Volvo&nbsp;покупка</strong>,&nbsp;<strong>продажа</strong>,&nbsp;<strong>автозапчастей </strong>в<strong> %city%</strong>. Для марок&nbsp;<strong>автомобилей</strong>:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>C30</strong></li>\r\n<li style="text-align: left;"><strong>S40</strong></li>\r\n<li style="text-align: left;"><strong>S60</strong></li>\r\n<li style="text-align: left;"><strong>S80</strong></li>\r\n<li style="text-align: left;"><strong>V50</strong></li>\r\n<li style="text-align: left;"><strong>XC60</strong></li>\r\n<li style="text-align: left;"><strong>XC70</strong></li>\r\n<li style="text-align: left;"><strong>XC90</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong> <strong>Volvo&nbsp;</strong> - Шведский концерн. Специализиуется производством коммерческих и грузовых автомобилей, так же автобусы, двигатели и различное оборудование. Ранее концерн <strong>Вольво</strong> производил также легковые автомобили, но затем, в 1999 продал своё отделение легковых автомобилей концерну Ford, который в 2010 перепродал его концерну Geely. Любые <strong>автозапчасти</strong> для <strong>автомобиля </strong>Volvo в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>'),
