(362, 'Geely', 'Geely, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'Geely - все автодетали для автомобиля Acura', 'Geely - автомобиль, производство Китай, покупка продажа запчастей для Geely: CHERY', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>Geely</strong>&nbsp;- <strong>автомобиль</strong>, производство Китай, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul style="padding-right: 40px;">\r\n<li style="text-align: left;"><strong>CHERY</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Geely Automobile</strong>&nbsp;&nbsp;&mdash;&nbsp;<span class="Apple-style-span">Китайская</span>&nbsp;автомобилестроительная компания. Главная компания&nbsp;&mdash; многопрофильная группа "<span class="Apple-style-span">Geely Holding Group"</span>, которая была создана в&nbsp;<span class="Apple-style-span">1986 году</span>.&nbsp;Производство&nbsp;<span class="Apple-style-span">автомобилей</span>&nbsp;началось в&nbsp;<span class="Apple-style-span">1998 году</span>. В&nbsp;<span class="Apple-style-span">2003 году</span>&nbsp;начались экспортные поставки автомобилей.&nbsp;В ноябре&nbsp;<span class="Apple-style-span">2009 <strong>года</strong> было</span>&nbsp;заключено соглашение с Yulon Group о совместном производстве&nbsp;<span class="Apple-style-span">электромобилей</span>. В&nbsp;<span class="Apple-style-span">2010 году совместная &nbsp;</span>компании планируют начинать продажу в Китае электромобиля на базе модели Panda. Автомобили марки&nbsp;<strong>&#8203;</strong><strong>Geely&nbsp;</strong>стали пользоваться успехом в России. Благодоря своей "новизне" и <strong>ценам&nbsp;</strong>марка&nbsp;<strong>&#8203;</strong><strong>Geely&nbsp;</strong>успела обзовестись тока положительными <strong>отзывами </strong>своих Российских потребителей. Любые <strong>автозапчасти</strong> для <strong>Geely</strong> в <strong>%city%</strong></p>'),
(365, 'TAGER', 'TAGER, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'TAGER автозапчасти , покупка , продажа', 'TAGER продажа , покупка авто запчастей. Для марок: KIT. ', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>TAGER&nbsp;продажа</strong>&nbsp;,&nbsp;<strong>покупка</strong>&nbsp;<strong>автозапчастей</strong>&nbsp;в<strong> %city%</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>KIT</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong></p>'),
(364, 'MINI', 'MINI, автомобиль, запчасти, автозапчасти, покупка, продажа,каталог,купить,продать', 'MINI автозапчасти , покупка , продажа', 'MINI - автомобиль, производство Великобритания, покупка продажа запчастей для MINI: COOPER.', '<p>&nbsp;</p>\r\n<p style="text-align: left;"><strong>MINI</strong>&nbsp;-&nbsp;<strong>автомобиль</strong>, производство Великобритания, продажа&nbsp;<strong>автозапчастей</strong>. Для марок:</p>\r\n<ul>\r\n<li style="text-align: left;"><strong>COOPER</strong></li>\r\n</ul>\r\n<p style="text-align: left;"><strong>&#8203;</strong><strong>Mini</strong>&nbsp;&mdash; марка автомобилей, производимых корпорацией BMW. В&nbsp;<span class="Apple-style-span">2007 году</span>&nbsp;объём производства составил двести тридцать семь тысяч семьсот девять автомобилей. Автомобиль родом из Великобритании. <strong>Старый </strong>и всем известный&nbsp;<strong>Mini</strong>&nbsp;<strong>COOPER&nbsp;</strong>стал автомобилем номер один в <strong>истории </strong>автомобилей своего класса, благодоря своим <strong>размерам</strong>. Любые <strong>автозапчасти</strong> для <strong>автомобиля Мини </strong>в<strong> %city%</strong>.</p>\r\n<p>&nbsp;</p>');
INSERT INTO `carmodel` (`m_id`, `m_name`, `m_brend_id`, `m_meta_keys`, `m_meta_title`, `m_meta_description`, `m_meta_html`) VALUES
(1, 'cl', 3, '2', '1', '3', '<p>HELLO12ав</p>\r\n<p>ыавы34442</p>'),
(2, 'csx', 3, '', '', '', '<p>Автомобиль Acura CSX был выпущен в ноябре 2005 году. Автомобиль Acura CSX является четырёхдверным седаном.&nbsp;</p>\r\n<p>Акура CSX имеет две модификации - Touring и Premium. Двигатель автомобиля Acura - "VTEC" имеет распределенный впрыск бензина,&nbsp;</p>\r\n<p>газораспределительным механизмом DOHC и развивает мощность в 157 л.с. Acura CSX соответствует экологическому стандарту EURO IV.&nbsp;</p>\r\n<p>Благодаря передней подвеске типа McPherson машина Акура CSX имеет хорошее сцепление с дорогой и легко управляется на трассе.&nbsp;</p>\r\n<div>&nbsp;</div>'),
(3, 'el', 3, '', '', '', ''),
(4, 'integra', 3, '', '', '', ''),
(5, 'mdx', 3, '', '', '', '<p>Внедорожник класса &laquo;люкс&raquo; MDX стал в 2003 году самой популярной моделью марки Acura.&nbsp;</p>\r\n<p>Концерн Honda Motor в 2004 году подготовил модернизацию своего внедорожник класса &laquo;люкс&raquo; MDX,&nbsp;</p>\r\n<p>впервые представленного в 2000 году. Внешние отличия &ndash; новый улучшенный бампер,&nbsp;</p>\r\n<p>передние фары с раздельными линзами, конечно новая решетка радиатора, сдвоенные выхлопные трубы и ряд других улучшений.</p>\r\n<p>В салоне так же есть изменения, появились новая центральная консоль, так же новое рулевое колесо и многое другое.</p>'),
(6, 'nsx', 3, '', '', '', ''),
(7, 'rdx', 3, '', '', '', ''),
(8, 'rl', 3, '', '', '', ''),
(9, 'rsx', 3, '', '', '', ''),
(10, 'slx', 3, '', '', '', ''),
(11, 'tl', 3, '', '', '', ''),
(12, 'tsx', 3, '', '', '', ''),
(13, 'zdx', 3, '', '', '', ''),
