(15, '200', 5, '', '', '', ''),
(16, '80', 5, '', '', '', ''),
(17, '90', 5, '', '', '', ''),
(18, 'a1', 5, '', '', '', ''),
(19, 'a2', 5, '', '', '', ''),
(20, 'a3', 5, '', '', '', '<div style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; background-color: #ffffff;">\r\n<p>&nbsp;</p>\r\n<p>Audi A3 &mdash; новый стандарт компактного автомобиля класса &laquo;премиум&raquo;.</p>\r\n<p>Утонченный &nbsp;дизайн, новые технологии и великолепная отделка салона делают автомобиль еще более стильным.</p>\r\n<p>Узнаваемая плавность линий и выразительные очертания придают динамизм внешнему виду A3.&nbsp;</p>\r\n<p>Передовые технологии позволяют путешествовать быстро и с максимальным комфортом.</p>\r\n<p>Многофункциональное оборудование салона делает A3 не только удобным, но и безопасным.</p>\r\n<p>&nbsp;</p>\r\n</div>'),
(21, 'a4', 5, '', '', '', '<p>Audi A4 &ndash; создана для сильных личностей. Она восхищает своей мощью и динамикой. Audi A4 выпускается в двух вариантах: бензиновый с турбодвигателем 1.8 л TFSI мощностью 160 л.с.</p>\r\n<p>и дизельный 2.0 TDI мощностью 143 л.с. Audi A4 автомобиль который нельзя не заметить : большая решетка радиатора, впечатляющие воздухозаборники,&nbsp;</p>\r\n<p>соединенные своеобразным вырезом, а сверху незабываемые светодиоды фар, фирменного стиля Audi.</p>'),
(22, 'a5', 5, '', '', '', '<p>Новое творение спортивного купе <strong>Audi A5</strong> - отражение элегантности, динамики и комфорта немецких автомобилей.</p>\r\n<p>Четыре комфортных сиденья и конечное же объемный багажник делают <strong>Audi A5</strong> незаменимым автомобилем в длительных поездках.</p>\r\n<p>Динамические характеристики обеспечивают высокотехнологичные двигатели FSI и TDI, имеющие в своей упряжке от 170 до 265 лошадей,&nbsp;при этом особое внимание уделяется не только их эффективности, но и экологической составляющей.&nbsp;</p>\r\n<p>Audi A5 создана на новой платформе <strong>Audi</strong> MLP (Modular Longitudinal Platform), основное отличие которой заключается в компоновке:&nbsp;для лучшего распределения веса по осям силовой агрегат был смещен назад. Также купе получило абсолютно новую трансмиссию,&nbsp;сочетающую утонченность управления с полной безопасностью езды.</p>'),
(23, 'a6', 5, '', '', '', '<p><strong>Audi A6</strong> - это одна из самых удачных и популярных моделей фирмы, автомобиль высшего среднего класса.</p>\r\n<p><strong>Audi A6</strong> выпускается с полностью оцинкованным кузовом, с вариантом переднего или полного (quattro) привода, широким разнообразием бензиновых&nbsp;и дизельных двигателей, расположенных спереди продольно, с механической&nbsp;и автоматической коробками передач. На автомобиль <strong>Audi A6</strong> устанавливается практически все виды новых двигателей <strong>Audi</strong> &mdash; начиная&nbsp;от 1,8 литра заканчивая 4,2 литровых, включая дизельные моторы 1,9 литра битурбо и 2,5 литровый TDI.&nbsp;Бензиновые двигатели имеют по пять клапанов на цилиндр.</p>'),
(24, 'a7', 5, '', '', '', ''),
(25, 'a8', 5, '', '', '', '<p>Автомобиль<strong> AUDI A8</strong> Впервые была показана в феврале 1994.<strong> А8</strong> &mdash; это автомобиль класса &laquo;люкс&raquo;, который первый в мире&nbsp;выпускался большой серией. Автомобиль выпускается с передним приводом, а так же с полным quattro приводом, несущим кузовом из алюминиевого сплава,&nbsp;данный кузовной сплав изготавливается по эксклюзивной технологии <strong>Audi</strong> Space Frame&reg;.</p>'),
(26, 'allroad', 5, '', '', '', '<p><strong>A6 Allroad</strong> Quattro &mdash; полноприводный универсал среднего класса, созданный на базе<strong> A6</strong> Avant.&nbsp;</p>\r\n<p>В 2006 году стартовало второе поколение <strong>Allroad</strong> Quattro.</p>\r\n<p>Особенностью <strong>Allroad</strong> является активная пневмо-подвеска. Автоматика следит за состоянием дороги и изменяет клиренс авто .&nbsp;</p>\r\n<p><strong>Allroad</strong> отлично ведет себя в любых дорожных условиях. Вместительный и комфортабельный, и обладает расширенными возможностями.</p>\r\n<p><strong>Allroad</strong> является лидером в своем классе&nbsp;</p>\r\n<div>&nbsp;</div>'),
(27, 'cabriolet', 5, '', '', '', ''),
(28, 'coupe', 5, '', '', '', ''),
(29, 'q5', 5, '', '', '', '<p>Новый <strong>Audi Q5</strong> - это внедорожник нового поколения. <strong>Audi Q5</strong> предпочитает доказывать, а не уговаривать.&nbsp;</p>\r\n<p>Новый <strong>Audi Q5</strong> идеален, и эта идеальность не исключает удовольствие от вождения. Он спортивен, но при этом лишен безрассудства.&nbsp;</p>\r\n<p>В нем сочетаются обсалютно новые технологии и традиции качества, такие как интеллект, комфорт и мощность.</p>'),
(30, 'q7', 5, '', '', '', ''),
(31, 'quattro', 5, '', '', '', ''),
(32, 'r8', 5, '', '', '', ''),
(33, 'rs4', 5, '', '', '', ''),
(34, 'rs6', 5, '', '', '', ''),
(35, 's2', 5, '', '', '', ''),
(36, 's3', 5, '', '', '', ''),
(37, 's4', 5, '', '', '', ''),
(38, 's5', 5, '', '', '', ''),
(39, 's6', 5, '', '', '', ''),
(40, 's8', 5, '', '', '', '<p><strong>audi S8</strong> полноприводной седан представительского класса спортивная модификация <strong>S8</strong>. Рестайлинг в 2005 г. первые модели <strong>audi S8</strong> были оснащены двигателем v образной восьмеркой последние модели v образной десяткой можно сказать без сомнений на дороге <strong>S8</strong> настоящий спорткар с видом седана класса люкс в этом его преимущество перед конкурентами.</p>'),
(41, 'tt', 5, '', '', '', '<p><strong>Audi TT</strong> &mdash; Уникальный автомобиль, выпускается как переднеприводный так и полноприводный. Спорткар среднего класса, в кузове купе или кабриолет. &nbsp;Название &laquo;<strong>TT</strong>&raquo; произошло от ежегодной гонки <strong>Tourist Trophy</strong>. Второе поколение автомобилей <strong>Audi ТТ</strong> дебютировало в 2006 году и завоевало звание &laquo;Лучший автомобильный дизайн года&raquo;.</p>'),
