(43, 'v8-d11', 5, '', '', '', ''),
(44, '1-series', 8, '', '', '', '<p><strong>BMW 1 серии</strong> представляет собой спортивную машину с незабываемыми очертаниями &ndash; эту спортивность подчеркивает вытянутой формы двери,&nbsp;и выделением боковых порогов. Строгая функциональность<strong> БМВ 1</strong> серии напоминает гоночные авто.&nbsp;</p>\r\n<p>Автомобили этой серии оснащаются EfficientDynamics &ndash; комплект интелектуальных решений, которые повышают одновременно мощность и сокращают расход топлива.&nbsp;</p>\r\n<p>Эти системы можно перечислять бесконечно они делают эксплуатацию автомобиля <strong>BMW</strong> максимально комфортной.</p>\r\n<div>&nbsp;</div>'),
(45, '3-series', 8, '', '', '', '<p><strong>BMW 3 серии</strong> является компактный автомобиль исполнительного производства немецкого автоконцерна <strong>BMW</strong> с мая 1975 года.</p>\r\n<p>Наследник нового класса<strong> BMW</strong>, было произведено в пяти разных кузовах. &nbsp;</p>\r\n<p>Это самый продаваемый автомобиль <strong>BMW</strong>,&nbsp;приходится около 40% автомобильных продаж компании <strong>BMW</strong> в 2005 году.</p>'),
(46, '5-series', 8, '', '', '', '<p><strong>BMW 5 серии</strong> является средним классом, производится автомобиль <strong>BMW 5</strong> с 1972 года. Представляет шестое поколение автомобилей <strong>BMW</strong>,&nbsp;производится в кузовах седан и универсал.</p>\r\n<p>Это вторая самая продаваемая модель <strong>BMW</strong>, после 3-й серии, представляет около 50% от прибыли компании.</p>'),
(47, '6-series', 8, '', '', '', ''),
(48, '7-series', 8, '', '', '', '<p><strong>BMW 7 серии</strong> представляет собой линейку роскошных автомобилей производства немецкого автопроизводителя <strong>BMW</strong>.</p>\r\n<p>Представленная в 1977 году, это предстовительский автомобиль <strong>BMW</strong>, и доступен только как седан или расширенного длинной лимузина.</p>\r\n<p><strong>7-й серии</strong> традиционно представляет технологии и тема внешнего вида автомобиля.</p>'),
