(54, 'x3', 8, '', '', '', '<p><strong>bmw x3</strong> является компактный кроссовер внедорожник, продается компанией немецкого автопроизводителя bmw. основанная&nbsp;на<strong> bmw 3 series</strong> автомобильной платформы и во втором поколении<strong> bmw x3</strong> разработан совместно с magna steyr в граце, австрия, которые производятся&nbsp;все <strong>x3s</strong> по контракту с <strong>bmw</strong> для первого поколения.</p>'),
(55, 'x5', 8, '', '', '', '<p><strong>BMW X5</strong> это роскошный внедорожник, среднего размера. Производство началось в 1999 году в качестве первого поколения E53. Это был первый <strong>BMW</strong> SUV (Sport Utility Vehicle), также известный как "четыре на четыре" (4х4) в Великобритании. Он оснащен полным приводом который заклеймен как "<strong>X</strong>". поставляется с ручной или автоматической коробкой передач.<strong>X5</strong> второго поколения, известный как E70, был запущен в 2006 году, первая версия M была обьявлена в 2009 году.</p>\r\n<p><strong>BMW X5</strong> автомобиль Sport Activity (SAV), а не внедорожник, (SAV) подчеркивает его на дороге, его способность, несмотря на его размер.&nbsp;</p>\r\n<p>&nbsp;</p>'),
(56, 'x5-m', 8, '', '', '', ''),
(57, 'x6', 8, '', '', '', '<p><strong>BMW X6</strong> является среднего размера роскошный кроссовер, выпущен в продажу во втором квартале 2008 года немецким автопроизводителем <strong>BMW</strong>.</p>\r\n<p><strong>X6</strong> представлен на рынке как Sports Activity Coupe (SAC). Она сочетает в себе атрибуты внедорожника (высокий клиренс, полный привод,&nbsp;большие колеса и т.д.)</p>'),
