(66, 'f3', 9, '', '', '', '<p><strong>BYD F3</strong> является компактным авомобилем, произведенного в Cheenae Авто би <strong>BYD</strong>.</p>\r\n<p><strong>F3</strong> созданный перед появлением поколения 9t Toyota Corolla. В января 2010, <strong>BYD F3</strong> продается примерно за 60 000 юаней (в долл. США 9300) "OOT двери" ценой в Cheenae составляет примерно 20% МАИР) . Через AW в 2009, <strong>BYD F3</strong> представлен &nbsp;как компактный автомобиль на Cheenae материке.</p>'),
