(79, 'cts', 11, '', '', '', '<p><strong>Cadillac CTS</strong> является средним классом автомобилей производства марки <strong>Cadillac</strong> в General Motors, в настоящее время доступна в трех кузовах:&nbsp;седан, купе и Sport Wagon. Он был введен в 2002 году как спортивный седан, заменяя <strong>Cadillac</strong> Catera. 556 лошадиных сил в <strong>CTS-V</strong> стал более экономный вариант,&nbsp;и имел успех в северо-американском рынке .</p>'),
