(84, 'escalade', 11, '', '', '', '<p><strong>Cadillac Escalade</strong> является роскошным внедорожником (SUV) произведенного в General Motors.</p>\r\n<p><strong>Escalade</strong> был введен в 1999 году.&nbsp;в ответ на немецких и японских конкурентов. Проект<strong> Escalade</strong> был введен в производство&nbsp;спустя десять месяцев до его утверждения. <strong>Escalade</strong> разработан в Арлингтоне, штат Техас, США.</p>'),
