(87, 'srx', 11, '', '', '', '<p><strong>Cadillac SRX</strong> представляет собой роскошный кроссовер.</p>\r\n<p><strong>SRX</strong> был введен в производство в 2004 году. Включают в себя двигатели различных вариантов - 4,6 л Northstar V8 320л.с. и 260л.с. V6.&nbsp;Он поставляется с 5-ступенчатой автоматической коробкой передач,&nbsp;и системой AWD на все колеса.</p>'),
