(92, 'amulet', 12, '', '', '', '<p><strong>Chery Amulet</strong> &mdash; легковой автомобиль среднего класса, производства Китай. Производится с 2003 года фирмой<strong> Chery</strong> Automobile&nbsp;на заводе в КНР до 2010 года. Сейчас автомобили<strong> Chery Amulet</strong> так же производят в Египте и России.</p>\r\n<div>&nbsp;</div>'),
(93, 'fora', 12, '', '', '', '<p><strong>Chery FORA</strong> - переднеприводный пятиместный седан класса C. автомобиль производства<strong> Chery</strong> Automobile.<strong> Chery</strong> A516 имеет 1.6L двигатель, <strong>Chery</strong> A518 имеет 1.8L двигатель, и<strong> Chery</strong> A520 имеет 2.0L двигатель. <strong>Chery</strong> A5 ISG / BSG является первым китайским гибридным автомобилем, запущенным в массовое производство.</p>'),
(94, 'kimo-a1', 12, '', '', '', ''),
