(98, 'sweet-qq', 12, '', '', '', '<p><strong>CHERY SWEET</strong>-<strong>QQ</strong> - автомобиль созданный для города. Удобный, компактный, вместительный. Автомобиль производства китайского автомобильного производителя <strong>Chery</strong> Automobile, производится с 2003 года. В 2006 году автомобиль был переименован в <strong>Chery</strong> <strong>QQ</strong>6, когда <strong>Chery</strong> начала производство их новой модели "супермини".</p>'),
(99, 'tiggo', 12, '', '', '', '<p><strong>Chery Tiggo</strong> представляет собой компактный внедорожник.</p>\r\n<p>Автомобиль производства китайского автомобильного производителя <strong>Chery</strong> Automobile, производится с 2006 года. Это пятидверный кроссовер доступен как передний привод, так и привод на четыре колеса с 1,6, 2,0 и 2,4-литровым бензиновым двигателем.</p>\r\n<div>&nbsp;</div>'),
