(104, 'aveo', 13, '', '', '', '<p><strong>Chevrolet Aveo</strong> является малолитражным автомобилем выпускаемым с 2002 года, первоначально южнокорейским автопроизводителем General Motors (GM),&nbsp;</p>\r\n<p>Продается по всему миру в 120 странах мира. Первое поколение <strong>Aveo</strong> изначально называлась Daewoo Kalos на внутреннем рынке Южной Кореи и многих экспортных рынков.</p>\r\n<p><strong>Chevrolet Aveo</strong> имеет большой диапозон комплектаций двигателей - 1.2 л SOHC S-TEC, 1.4 л SOHC E-TEC II и 1.2 л DOHC E-TEC II, 1.4 ECOTEC, 1.5 л E-TEC II, 1.6 л DOHC E-TEC II.</p>'),
