(108, 'caprice', 13, '', '', '', ''),
(109, 'captiva', 13, '', '', '', '<p><strong>Chevrolet Captiva</strong> это кроссовер разработанный южнокорейским подразделением General Motors&nbsp;и продается под брендом<strong> Chevrolet</strong>. <strong>Captiva</strong> использует платформу GM Theta, и вытекает из концепции <strong>Chevrolet&nbsp;</strong>S3X автомобиль 2004 года. Платформа Theta также лежит в основе Opel Antara.</p>\r\n<div>&nbsp;</div>'),
