(118, 'cruze', 13, '', '', '', '<p><strong>Chevrolet Cruze</strong> автомобиль производства General Motors.</p>\r\n<p><strong>Cruze</strong> имеет два типа кузова - четырех дверный седан,и пяти дверный хетчбэк.</p>\r\n<p>Диапазон двигателей устанавливаемых в <strong>Chevrolet Cruze</strong> варьирует от бензинового 1,6 л (109 л. с.),&nbsp;до турбодизельного 2,0 литровый (150 л. с.). Так же имеется бензиновый Ecotec 1.4L turbo (138 л. с.).</p>'),
(119, 'epica', 13, '', '', '', '<p><strong>Chevrolet Epica</strong> &mdash; автомобиль бизнес-класса, переднеприводный седан. Производства корейского подразделения <strong>Chevrolet</strong>.</p>\r\n<p>Оснащается двигателями объёмом 2,0 литра (144 л.с.) и 2,5 литра (156 л.с.).&nbsp;</p>\r\n<p>Оснащается пяти ступенчатой механической и пяти ступенчатой автоматической коробкой передач,&nbsp;так же имеется шести ступенчатая автоматическая коробка передач.</p>'),
