(125, 'lacetti', 13, '', '', '', '<p><strong>Chevrolet Lacetti</strong> &mdash; автомобиль среднего "С" класса&nbsp;созданный автопроизводителем GM Daewoo в Южной Кореи. Выпускается&nbsp;в кузовах - седан, хетчбэк и универсал.</p>\r\n<p>Двигатели в <strong>Chevrolet Lacetti</strong> делятся на три категории: 1.4 литра (94 л.с.), 1.6 литра (109 л.с.), 1.8 литра (122 л.с.).&nbsp;</p>'),
(126, 'lanos', 13, '', '', '', '<p><strong>CHEVROLET Lanos</strong> это малолитражный автомобиль производства корейского автопроизводителя Daewoo Motor с 1997 по 2002,&nbsp;а с 1997 по 2008 год, сделанное в соответствии с лицензионным соглашением по Fabryka Samochod&oacute;w Osobowych (FSO)&nbsp;в Польше, которые реализуются как FSO <strong>Lanos</strong>, и собранных в Украине в модифицированные версии известной как Daewoo&nbsp;Sens и <strong>Chevrolet Lanos</strong>. <strong>Chevrolet Lanos</strong> также производится и продается в Египте, с ноября 2008 по настоящее время.</p>'),
(127, 'lumina', 13, '', '', '', ''),
