(130, 'monte-carlo', 13, '', '', '', ''),
(131, 'monza', 13, '', '', '', ''),
(132, 'niva', 13, '', '', '', '<p><strong>Chevrolet Niva</strong> &mdash; российский компактный вседорожник. Шевроле нива является внедорожником, и поэтому в нем используется постоянный полный привод.</p>\r\n<p>Автомобиль оснащен двигателем объёмом (1,7-литров) и мощностью (80 л.с.)</p>\r\n<p><strong>Chevrolet Niva</strong> это самый продаваемый вседорожник в России в период 2004&mdash;2008 годах.</p>'),
(133, 'nubira', 13, '', '', '', ''),
(134, 'omega', 13, '', '', '', ''),
(135, 'prizm', 13, '', '', '', ''),
(136, 'rezzo', 13, '', '', '', '<p><strong>CHEVROLET REZZO</strong> является компактный автомобиль для города, производства южнокорейской GM Daewoo с 2000 года. Развитые под кодовым названием U100, он был разработан Pininfarina и основан на оригинальной Daewoo Nubira J100.</p>\r\n<p>После постепенного отказа от Daewoo в качестве торговой марки в большинстве экспортных рынков, автомобиль продется под маркой <strong>Chevrolet</strong>.&nbsp;</p>'),
(137, 's-10-pickup', 13, '', '', '', ''),
(138, 'ssr', 13, '', '', '', ''),
(139, 'sail-s-rv', 13, '', '', '', ''),
(140, 'spark', 13, '', '', '', '<p><strong>CHEVROLET SPARK</strong> является городской автомобиль производства южнокорейского автопроизводителя GM Korea, которые продаются по всему&nbsp;миру с 1998 года, когда он заменил Daewoo Tico. Он доступен исключительно как пятидверный хэтчбек с двумя конфигурациями двигателя.</p>\r\n<p>SPARK был первоначально разработан Italdesign Giugiaro. Различные поколения автомобилей были проданы&nbsp;в рамках как Daewoo и различных марок GM, и были произведены и продаются по лицензионным соглашениям местных автопроизводителей в&nbsp;нескольких странах.</p>'),
(141, 'suburban', 13, '', '', '', ''),
(142, 'tahoe', 13, '', '', '', '<p><strong>Chevrolet Tahoe</strong> полноразмерный внедорожник американской компании General Motors. Марки <strong>Chevrolet</strong> и GMC&nbsp;внедорожники под именем Blazer (У <strong>Chevrolet</strong>) и Jimmy (У GMC) вплоть до начала 1990-х. Позже полноразмерный Jimmy был переименован GMC в Yukon.&nbsp;</p>\r\n<p>В 1994 году компанией <strong>Chevrolet</strong> началось производство четырехдверного внедорожника, а полноразмерную версию назвали <strong>Tahoe</strong>.&nbsp;</p>'),
(143, 'tavera', 13, '', '', '', ''),
(144, 'tracker', 13, '', '', '', ''),
(145, 'trailblazer', 13, '', '', '', '<p><strong>Chevrolet TrailBlazer</strong> это внедорожник, американского автопроизводителя General Motors.</p>\r\n<p>Он был введен в 1999 году в качестве высококлассного линии автомобилей <strong>Blazer</strong>. В 2002 году <strong>TrailBlazer</strong> был обновлен до новой платформы&nbsp;(GMT360 на 5 пассажирских мест, GMT370 на 7 пассажиров). Производство<strong> Blazer</strong> пересекается с <strong>TrailBlazer</strong> до 2005 года,&nbsp;2-дверный<strong> Blazer</strong> был заменен Chevrolet Equinox после 2005 года.</p>\r\n<div>&nbsp;</div>'),
