(150, 'viva', 13, '', '', '', '<p><strong>Chevrolet Viva</strong> является небольшим семейныйм автомобилем, построенный GM-АвтоВАЗ в 2004 году и продается только в России. Он основан на 4-дверном седане Opel Astra G / B, который был произведен в период с 1998 по 2004 год.</p>\r\n<p><strong>Viva</strong> в России продавалась через официальных диллеров <strong>Chevrolet</strong>, в то время как дилеры Opel были постващиками нового Opel Astra H / C. Продажи были плохими с самого начала из-за высоких цен: только стартовая версия &nbsp;была запущена с 1.8L двигателем, Цены на<strong> Viva</strong> были выше Toyota Corolla и Volkswagen Jetta. Проект стоимостью 340 миллионов долларов продает менее тысячи автомобилей в год. GM-АвтоВАЗ закрыл мелкие производства <strong>Viva</strong> в марте 2008 года.</p>'),
