(175, 'voyager', 14, '', '', '', '<p><strong>Chrysler Voyager</strong> или <strong>Chrysler Grand Voyager</strong> является минивэн, продажи ведутся американским автопроизводителем&nbsp;<strong>Chrysler</strong> Group LLC. На протяжении большей части своего существования, автомашины с табличкой <strong>Chrysler Voyager</strong> были проданы&nbsp;исключительно за пределами Соединенных Штатов, в первую очередь в Европе и Мексике.</p>\r\n<p><strong>Voyager</strong> был представлен в Европе в 1988 году.автомобили <strong>Chrysler Voyager</strong> некоторое время продавались в Соединенных Штатах с 2001-2003 под маркой&nbsp;(SWB) вариант Plymouth Voyager.</p>'),
(176, '2-cv', 15, '', '', '', ''),
(177, 'ax', 15, '', '', '', ''),
(178, 'bx', 15, '', '', '', ''),
(179, 'berlingo', 15, '', '', '', '<p><strong>Citroen Berlingo</strong> - автомобиль производства французского Citro&euml;n производится с 1996 года.&nbsp;Она была основана на Citroen ZX / Peugeot 306.</p>\r\n<p><strong>Berlingo</strong> использует тот же корпус и выглядит очень похожим на Peugeot 306. Он был запущен в 1996 году&nbsp;и пересмотренный вариант с участием переработанного интерьера была выпущена в ноябре 2002 года.</p>\r\n<p>Версия легкового автомобиля названа Multispace, и хорошо продается в нескольких европейских странах из-за своей практичности и&nbsp;сравнительно низкие цены.</p>'),
(180, 'c-crosser', 15, '', '', '', ''),
(181, 'c1', 15, '', '', '', ''),
(182, 'c2', 15, '', '', '', '<p><strong>Citroen C2</strong> &mdash; автомобиль производства <strong>Citroen</strong>. Городской, легковой автомобиль. В 2005 году автомобиль был видоизменен:&nbsp;были изменены фары, элементы салона и электроника.</p>\r\n<p>С осени 2006 года в Китае продаётся видоизменённый Peugeot 206, названный <strong>Citroen C2</strong>.</p>'),
(183, 'c3', 15, '', '', '', '<p><strong>Citroen С3</strong> компактный городской автомобиль, которые был произведен французским&nbsp;автопроизводитель<strong> Citroen</strong> &nbsp;с 2002 года. Версия мини-MPV из <strong>С3</strong> было объявлено&nbsp;в июле 2008 года под названием <strong>C3</strong> Picasso, представленная на Mondial де l''Automobile 2008 году и поступил в продажу в начале&nbsp;2009 года по всей Европе.</p>'),
(184, 'c4', 15, '', '', '', '<p><strong>Citroen C4</strong> это компактный семейный автомобиль, производства компании Citroen, одного из крупнейших французских автопроизводителей, с осени 2004 года.</p>\r\n<p><strong>C4</strong> был разработан, чтобы заменить <strong>Citroen</strong> Xsara. Он похож на Peugeot 308, который был запущен в 2007 году.&nbsp;Пересмотренный вариант с новой передней частью, измененной приборной панелью был запущен 2008/09 модельного года.&nbsp;</p>\r\n<p>В январе 2010 года было объявлено, что производство купе версии должно было быть прекращено.&nbsp;<strong>С4</strong> получил награду - 2-е место в 2005 году, как Европейский Автомобиль Года.</p>\r\n<div>&nbsp;</div>'),
(185, 'c5', 15, '', '', '', '<p><strong>Citroen C5</strong> является большим семейным автомобилем, производства французского автопроизводителя <strong>Citroen</strong>. Производство началось с начала 2001 года.</p>\r\n<p><strong>С5</strong> заменил Citroen Xantia в классе больших семейных автомобилей. Автомобили <strong>Citroen C5</strong> оснащаются 1,8 и 2,0-литровыми двигателями и&nbsp;3,0 литровым V6 бензиновым двигателем. Так же в автомобили<strong> C5</strong> устанавливаются 1.6,2.0 и 2,2-литровые дизельные двигатели.</p>'),
(186, 'c6', 15, '', '', '', ''),
(187, 'c8', 15, '', '', '', ''),
(188, 'cx', 15, '', '', '', '<p><strong>Citroen СХ</strong> автомобиль производства французского автопроизводителя <strong>Citroen</strong>. Автомобиль производится с 1974 по 1991 год.&nbsp;</p>\r\n<p><strong>Citroen</strong> продала 1,2 миллиона <strong>CX</strong>&nbsp;в течение 16 лет своего производства. <strong>CX</strong> был признан европейским автомобилем года в 1975 году.</p>'),
