(198, 'espero', 16, '', '', '', '<p><strong>Daewoo Espero</strong> автомобиль производства южнокорейской компании <strong>Daewoo</strong> Motors с 1990 по 1997 год. Это был технически проект на платформе GM J.</p>\r\n<p>Автомобили оснащались двигатеями Holden GM Family I 1,5-литровым двигателем, а Family II 1,8 или 2,0-литровым двигателями.</p>\r\n<p><strong>Espero</strong> был заменен <strong>Daewoo</strong> Leganza в 1997 году.</p>'),
