(209, 'matiz', 16, 'Daewoo Matiz, Matiz, запчасти, авто запчасти, продажа авто запчастей, продажа авто запчастей в России, продажа, автозапчасти', 'Daewoo Matiz - автомобиль производства Южная Корея, автозапчасти для Daewoo Matiz', '', '<p><strong>Daewoo Matiz</strong> является городским автомобилем производства южнокорейского автопроизводителя GM Korea, которые продаются по всему миру&nbsp;</p>\r\n<p>с 1998 года, когда он заменил <strong>Daewoo</strong> Tico. <strong>Дэу матиз</strong> доступен исключительно как пятидверный хэтчбек с двумя конфигурациями двигателя.</p>\r\n<p><strong>Matiz</strong> был первоначально разработан Italdesign Giugiaro. Различные поколения автомобилей были проданы&nbsp;</p>\r\n<p>в рамках как <strong>deu</strong> и различных марок GM, и были произведены и продаются по лицензионным соглашениям местных автопроизводителей</p>\r\n<p>в нескольких странах.Было построено, между 1998 и 2006 годах, более 2,3 млн. единиц автомобиля<strong> Дэу Матиз</strong> в мире.</p>'),
(210, 'musso', 16, '', '', '', ''),
(211, 'nexia', 16, 'Daewoo Nexia, Nexia, запчасти, автозапчасти, продажа авто запчастей, продажа авто запчастей в России, продажа', 'Daewoo Nexia - автомобиль производства Корея, авто запчасти для Daewoo Nexia', '', '<p><strong>Daewoo Nexia</strong> &mdash; автомобиль, появившийся на свет после модернизации Opel Kadett E в 1995 году. <strong>Нексия</strong> производится с кузовом седан. <strong>Дэу нексия</strong> продаётся в двух основных комплектациях &mdash; &nbsp;GL и GLE (&laquo;люкс&raquo;). Расширенная комплектация (GLE) включает в себя непосредственно модернизированный внешний вид, так и много улучшений для комфорта. В автомобиле<strong> Daewoo Nexia</strong> есть возможность установке кондиционера и гидроусилителя руля, но часть машин для удешевления ими не оснащается.<strong>&nbsp;Deu neksiya</strong> в период с 1996 года по 2008 год была укомплектована двигателем G15MF, объёмом 1,5 литров (75 л.с.).&nbsp;</p>'),
