(220, 'avenger', 17, '', '', '', '<p><strong>Avenger Dodge</strong> среднеразмерный седан, построенный Chrysler Corporation для марки <strong>Dodge</strong>.&nbsp;</p>\r\n<p>В своем первоначальном дебюте,<strong> Avenger</strong> производился с 1995 по 2000 год, как 2-дверное купе. Он был вновь представлен&nbsp;на рынке как 4-дверный спортивный седан, в начале 2008 года.</p>'),
(221, 'caliber', 17, '', '', '', '<p><strong>Dodge Caliber</strong> является компактный автомобиль производства Chrysler. Он пришел на смену Neon,&nbsp;и поступил в продажу весной 2006 года как автомобиль 2007 модельного года. <strong>Caliber</strong> это пятидверный хэтчбек,&nbsp;но из-за его громоздкого внешнего вида, этот автомобиль можно также рассматривать как универсал или кроссовер.</p>'),
