(259, 'albea', 19, '', '', '', '<p><strong>Fiat Albea</strong> автомобиль производства FIAT S.p.A. <strong>Albea</strong> является версией седана<strong> Fiat</strong> Palio небольшой семейный автомобиль. &nbsp;</p>\r\n<p>У автомобиля <strong>Fiat Albea</strong> установлена низкая стоимость, направленная на рынки развивающихся стран.<strong>&nbsp;Albea</strong> был разработан итальянским дизайнером Джорджетто Джуджаро.</p>'),
