(266, 'doblo', 19, '', '', '', '<p><strong>Fiat Doblo</strong> &mdash; автомобиль производства компании <strong>Fiat</strong>. Автомобиль выпускается с 2000 года. Автомобиль производится во многих странах мира.</p>\r\n<p>Осенью 2005 года в автомобилях <strong>Doblo</strong> были произведены видоизменения. Был заметно изменен дизайн, изменению подверглись передний и задний блок фар.</p>'),
