(275, 'panda', 19, '', '', '', '<p><strong>Fiat Panda</strong> является городским автомобилем, созданный итальянским автопроизводителем <strong>Fiat</strong>. Первый <strong>Fiat Panda</strong> была введена в 1980 году,&nbsp;и была выпущена до 2003 года лишь с небольшими изменениями.Вторая модель запущенная в 2003 году, которую иногда называют "Новая <strong>Panda</strong>".</p>\r\n<p>Дебют третьего поколения на Франкфуртском автосалоне в сентябре 2011 года будет собран в Италии в Помильяно д''Арко.</p>\r\n<div>&nbsp;</div>');
INSERT INTO `carmodel` (`m_id`, `m_name`, `m_brend_id`, `m_meta_keys`, `m_meta_title`, `m_meta_description`, `m_meta_html`) VALUES
(276, 'punto', 19, '', '', '', '<p><strong>Fiat Punto</strong> это маленький автомобиль от <strong>Fiat</strong>. Он пришел в рынок как преемник <strong>Fiat</strong> Uno, <strong>Punto</strong> автомобиль созданный в Германии в ноябре 1993 года, на рынке продается новая версия <strong>Punto&nbsp;</strong>с 2005 года. Дизайн автомобиля создан Джорджетто Джуджаро. <strong>Punto</strong> это автомобиль, которому первому в своем классе был частично оцинкован кузов.</p>'),
(277, 'sedici', 19, '', '', '', ''),
(278, 'seicento', 19, '', '', '', ''),
(279, 'siena', 19, '', '', '', '<p><strong>Fiat Siena</strong> это четырехдверный седан, предшественника версии <strong>Fiat</strong> Palio, кузов - седан. Автомобили Siena разработаны специально для развивающихся стран. Автомобиль похож на <strong>Fiat</strong> Albea.</p>\r\n<p><strong>Siena</strong> производится в Бразилии, Аргентине, Турции, Польше, Индии, ЮАР, Китай, Иран, и во Вьетнаме.&nbsp;</p>'),
