(288, 'c-max', 20, '', '', '', '<p><strong>Ford C-Max</strong> является вместимым городским автомобилем, производства компании <strong>Ford&nbsp;</strong>для Европы с 2003 года и в Северной Америке с 2011 года.</p>\r\n<p>Хотя <strong>C-MAX</strong> был первоначально доступна только в Европе. С введением новых крупных минивэнов&nbsp;<strong>S-Max</strong> и Galaxy, <strong>C-Max</strong> является самым маленьким минивэном модельного ряда <strong>Ford</strong>.</p>'),
(289, 'contour', 20, '', '', '', ''),
