(291, 'crown-victoria', 20, '', '', '', ''),
(292, 'econoline', 20, '', '', '', ''),
(293, 'edge', 20, '', '', '', ''),
(294, 'escape', 20, '', '', '', '<p><strong>Ford Escape</strong> компактный внедорожник компании <strong>Ford</strong> Motor Company. Хотя технически это кроссовер, <strong>Escape</strong> продается Фордом в рамках своей традиционной линейке внедорожников (Escape, Explorer, Expedition), а не отдельных ее линейке кроссовера (Edge, Flex). <strong>Escape</strong> был продан в Европе как Maverick <strong>Ford</strong>.Он был разработан совместно с Mazda, В котором Форд владел контрольным пакетом акций, и был выпущен одновременно с Mazda Tribute.&nbsp;</p>'),
(295, 'escort', 20, 'Ford Escort, автозапчасти, Ford , продажа запчастей, по всей России', 'Ford Escort - Производство Ford Motor Company, автозапчасти для Escort', 'qwe', '<div style="font-family: Verdana, Arial, Helvetica, sans-serif; font-size: 10px; background-color: #ffffff;">\r\n<p>&nbsp;</p>\r\n<p><strong>Ford Escort</strong>&nbsp;автомобиль производства&nbsp;<strong>Ford</strong>&nbsp;Motor Company в период&nbsp;между 1968 и 2003 годах.Название&nbsp;<strong>Escort</strong>&nbsp;было применено и к нескольким различным автомобилям в Северной Америке на протяжении&nbsp;многих лет. Двигатели установленные на&nbsp;<strong>Escort</strong>&nbsp;варьировали от 0.9-литров до 1.8-литровых.</p>\r\n<p>&nbsp;</p>\r\n</div>'),
(296, 'excursion', 20, '', '', '', ''),
(297, 'expedition', 20, '', '', '', ''),
(298, 'explorer', 20, 'Ford Explorer, Explorer, запчасти, авто запчасти, продажа авто запчастей, продажа авто запчастей в России, продажа, автозапчасти', 'Ford Explorer -  автомобиль производства Северная Америка, продажа автозапчастей для Ford Explorer', '', '<p><strong>Ford Explorer</strong> это спортивный внедорожник, продается в Северной Америке и построенный компанией <strong>Ford</strong> Motor в 1990 году.</p>\r\n<p>Он изготовлен в Чикаго, штат Иллинойс. <strong>Ford Explorer</strong> сыграл важную роль в превращении внедорожника в одном из самых популярных типов транспортных средств на дороге.&nbsp;</p>\r\n<div>&nbsp;</div>'),
