(385, 'elantra', 24, 'Hyundai Elantra, Elantra, запчасти, авто запчасти, продажа авто запчастей, продажа авто запчастей в России, продажа, автозапчасти', 'Hyundai Elantra - автомобиль производства Южной Кореи, автозапчасти для Hyundai Elantra', '', '<p><strong>Hyundai Elantra</strong>&nbsp;произведен в Южной Корее, является компактный автомобиль от <strong>хендай</strong>. Производство запущенно в октябре 1990 года,&nbsp;<strong>Элантра</strong> ранее была продан как Lantra в Австралии и некоторых европейских странах. В Австралии, это было связано с одноименной моделью&nbsp;Mitsubishi Magna Elante. Это привело к разногласиям от других производителей, также в 2001 году, имя было введено как&nbsp;"<strong>Elantra</strong>" во всем мире. (исключение составляют Кореи и Малайзии до сих пор продают под именем "Аванте").</p>'),
