(455, 'picanto', 28, 'Kia picanto, запчасти, авто запчасти, продажа авто запчастей, продажа авто запчастей в России, продажа, автозапчасти', 'Kia picanto - производство Южная Корея, автозапчасти для Kia picanto', '', '<p><strong>Picanto</strong> основан на укороченной платформе Hyundai Getz. Он доступен либо с 1,0 или 1,1 л бензиновым двигателем.3-цилиндровый&nbsp;дизельный двигатель с турбокомпрессором, был доступен на европейском рынке с весны 2004 года, мощностью 75 л.с.</p>\r\n<p>Автоматические коробки передач не являются обязательными в бензиновых версиях автомобидей <strong>Киа пиканто</strong>.&nbsp;Также автомобили <strong>Kia picanto</strong> продаются в некоторых странах с 1.2литровым двигателем.</p>'),
