(862, 'corolla', 49, 'Toyota Corolla, запчасти, автозапчасти, продажа авто запчастей, продажа авто запчастей по всей России', 'Toyota Corolla - автомобиль производства Японии, автозапчасти для Toyota Corolla', '', '<p><strong>Toyota Corolla</strong> представляет собой автомобиь среднего (С) класса, производится в японии автопроизводителем<strong> Toyota</strong>.&nbsp;</p>\r\n<p><strong>Тойота королла</strong> стала очень популярной моделью во всем мире. Марка <strong>тойота</strong> была впервые введена в 1966 году. В 1997 году&nbsp;<strong>Corolla</strong>&nbsp;стала самой&nbsp;продаваемой маркой в мире, с более чем 35 миллионов проданных экземпляров в 2007 году.</p>'),
