INSERT INTO `news` (`id`, `title`, `short_desc`, `full_desc`, `img`, `date_public`, `meta_title`, `meta_keys`, `meta_desc`, `last_update`) VALUES
(1, 'Несанкционированные работы в охранной зоне ЛЭП ставят под угрозу надежность электроснабжения и безопасность горожан', '<p>Вечером  31 марта в Челябинске от действия релейной защиты отключилась воздушная  линия 110 кВ ЧГРЭС-ТЗП 1. При аварийном осмотре ЛЭП персоналом  Центральных электросетей "Челябэнего" было установлено, что причиной  происшествия стали действия водителя автокрана...</p>', '<p>Вечером  31 марта в Челябинске от действия релейной защиты отключилась воздушная  линия 110 кВ ЧГРЭС-ТЗП 1. При аварийном осмотре ЛЭП персоналом  Центральных электросетей "Челябэнего" было установлено, что причиной  происшествия стали действия водителя автокрана, проводившего работы в  охранной зоне линии электропередачи (ЛЭП) без обязательного в таких  случаях согласования с сетевой компанией. Это является грубейшим  нарушением &laquo;Правил установления охранных зон электросетевого хозяйства&raquo;,  утвержденных Постановлением Правительства РФ №160 от 24.02.2009 года. <br /><br /> Непосредственно под проводами ВЛ 110кВ на пересечении улиц Салютная и  Горького (в районе Башни) автокраном устанавливался киоск. Машинист  приблизил стрелу крана на недопустимое расстояние к нижним проводам  линии. В результате произошел пробой воздушного промежутка и короткое  замыкание такой силы, что чугунная крышка канализационного люка,  находящаяся рядом с ригелем установленного автокрана, взлетела на высоту  до 2-х метров и повредила светофор. Движение автотранспорта на  оживленном городском перекрестке было остановлено и в последующем на  неопределенное время затруднено. Только по счастливой случайности в  момент короткого замыкания никто из многочисленных прохожих не  пострадал. <br /><br /> На аварийную ситуацию оперативно отреагировали сотрудники ДПС  Тракторозаводского района г. Челябинска. Задержанного водителя автокрана  сопроводили в 4 отделение Тракторозаводского УВД, для составления  протокола о нарушении. Водитель (он же владелец) автокрана и  ответственный за установку газетного киоска по ул. Салютная-Горького  выдают противоречивую и ложную информацию о заказчике данной работы.  Сотрудники 4 отделения Тракторозаводского УВД проводят розыскные  мероприятия для установления владельца киоска и заказчика данной работы.  В настоящий момент филиалом "МРСК Урала" - &laquo;Челябэнерго&raquo; готовятся  документы на возмещение причиненного ущерба.<br /><br /> &laquo;Челябэнерго&raquo; напоминает руководителям предприятий, организаций и всем  жителям Челябинской области, что ЛЭП &ndash; источник повышенной опасности и  представляет угрозу для здоровья и жизни людей! <br /><br /> Охранная зона для линий электропередачи напряжением 110 кВ, 35 кВ, 6-10  кВ и 0,4 кВ составляет, соответственно, 20, 15, 10 и два метра в обе  стороны от крайних проводов.<br /><br /> В охранных зонах ЛЭП запрещается осуществлять строительные, поливные  работы, производить рассадку и вырубку деревьев, устраивать загоны для  скота, сооружать ограждения садов и огородов, разводить огонь,  складировать корма, удобрения, солому, торф, дрова и другие материалы,  устраивать стоянки всех видов машин и механизмов, загромождать подъезды и  подходы к опорам ВЛ. <br /><br /> Несогласованные действия в охранной зоне ЛЭП могут привести к тяжелым последствиям!</p>\r\n<p>Источник: <a href="http://www.pulscen.ru/go?to=http%3A%2F%2Fwww.ruscable.ru%2Fcompany%2Fall%2Fmrsk_urala%2F" target="blank">Пресс-служба "Челябэнерго"</a></p>', 'a203aa72f65d6c78ad15d8075808ac73.jpg', '2012-02-06', '', '', '', '2012-02-06'),
(2, 'Обрушение крана в Н.Новгороде', '<p><em>В выходные на контейнерной площадке станции "Костариха" во время  погрузочных работ обрушился козловой кран. Многотонная конструкция, в  считанные секунды сложившись пополам, буквально смяла под собой  рабочего, которому было всего лишь 27 лет.</em></p>', '<p>На месте трагедии близкие и коллеги  попрощались с погибшим. Прессу на территорию не пустили. Руководство  контейнерной площадки от комментариев отказалось. На фотографиях,  предоставленных Приволжским следственным управлением на транспорте  Следственного комитета России, видно, что опора крана рухнула на  товарный вагон. <br /><br /> Дмитрий Захаров, старший инспектор Приволжского следственного управления  на транспорте Следственного комитета РФ, говорит: "Был произведен  осмотр места происшествия, получены объяснения всех очевидцев. Смерть  потерпевшего наступила мгновенно. По результатам доследственной  проверки, проведенной в рамках Уголовно&ndash;процессуального кодекса РФ,  будет принято окончательное решение об отказе возбуждения или  возбуждении уголовного дела".<br /><br /> В настоящее время по данному делу работает комиссия из специалистов  Следственного комитета, Ростехнадзора и Госинспекции по труду.  Отрабатываются две основные версии: неисправность крана и нарушение  правил погрузочно-разгрузочных работ.</p>\r\n<p style="text-align: justify;">Ссылка: <a href="http://www.pulscen.ru/go?to=http%3A%2F%2Fnnovgorod.rfn.ru%2Fv%2F48613.asf" target="blank">nnovgorod.rfn.ru/v/48613.asf</a></p>\r\n<p style="text-align: justify;">Источник:&nbsp;<a href="http://www.pulscen.ru/go?to=http%3A%2F%2Fnnovgorod.rfn.ru%2F" target="blank">ГТРК &laquo;Нижний Новгород&raquo;</a></p>', 'f8ef0d432548bbbb22bdbcd0facda596.jpg', '2012-02-06', '123', '', '', '2012-09-19'),
(3, 'Технологическая карта', 'Технологическая карта - что это такое?', '<p>Сегодня из-за большого количества вопросов что такое технологическая карта. Мы решили написать эту статью. Технологическая карта &ndash; это документ, содержащий необходимые сведения, инструкции для персонала, выполняющего некий технологический процесс или техническое обслуживание объекта. В большинстве случаев технологическая карта или ТК должна ответить на вопросы:</p>\r\n<p>1 - Какие операции необходимо выполнять</p>\r\n<p>2 - В какой последовательности выполняются операции</p>\r\n<p>3 - С какой периодичностью необходимо выполнять операции (при повторении операции 4 более одного раза)</p>\r\n<p>5 - Сколько уходит времени на выполнение каждой операции</p>\r\n<p>6 - Результат выполнения каждой операции</p>\r\n<p>7 - Какие необходимы инструменты и материалы для выполнения операции.</p>\r\n<p>Обычно ТК составляют для каждого объекта отдельно (в виде таблицы).</p>\r\n<p>И не забываем что закатать ТК для любого объекта можно у нас.</p>', '40758d643a569d1375a809031ef26aea.png', '2012-04-24', '', '', '', '2012-04-24'),
(4, 'Причины аварий и несчастных случаев при использовании кранов и подъемников.', 'Причины аварий и несчастных случаев при использовании кранов и подъемников.', '<p style="text-align: justify;"><span style="font-size: small;">Статистика характерных аварий и несчастных случаев, связанных с использованием кранов и подъемников свидетельствуют о том, что основными причинами этих чрезвычайных ситуаций являются:</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">- неправильный подбор и привязка кранов и подъемников;</span><br /><span style="font-size: small;">- неправильное определение границ опасных зон работы кранов и подъемников; </span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">- недостаточное обеспечение безопасности труда в опасных зонах работы кранов и подъемников;</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">- отсутствие или недостаточная разработка мероприятий по ограничению, при необходимости, опасной зоны работы крана; </span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">- нарушение правил установки кранов вблизи линий электропередачи и вблизи выемок;</span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">- нарушение правил складирования материалов, конструкций, изделий и оборудования на строительной площадке; </span></p>\r\n<p style="text-align: justify;"><span style="font-size: small;">- нарушение правил проведения погрузо-разгрузочных работ.</span><br /><br /><span style="font-size: small;">Таким образом, использование кранов и подъемников относится к процессам повышенной опасности, при проведении которых возникают опасные производственные факторы. </span><br /><br /><span style="font-size: small;"> В связи с этим безопасная установка и работа кранов и подъемников не верное толкование, т.к. эти производственные процессы изначально, в силу своей специфики, являются опасными.</span><br /><br /><span style="font-size: small;"> Методически правильной является постановка и формулировка задачи о необходимости обеспечения безопасности труда при проведении производственных процессов повышенной опасности, связанной с использованием кранов и</span><br /><span style="font-size: small;">подъемников.</span><br /><br /><span style="font-size: small;"> Для работодателей, специалистов, руководителей и рабочих возникает проблема обеспечения безопасных условий труда в условиях производственных процессов, характеризуемых повышенной опасностью.</span><br /><br /><span style="font-size: small;"> Для решения этой проблемы необходим проект производства работ (ППРк, ППРп), в котором разрабатывается система специальных мер по предупреждению и защите от опасных и вредных факторов, имеющих место при установке и работе кранов и подъемников. </span><br /><br /><br /><br /></p>', 'b65f27dd9fdb0ec7d20ab7fb190ee7f0.jpg', '2012-04-27', '', '', '', '2012-04-27'),
(6, 'Новость', 'Новая новость', '<p><img title="Cry" src="http://ziziz.ru/assets/d675f399/tiny_mce/plugins/emotions/img/smiley-cry.gif" border="0" alt="Cry" />ирпаррапр<span style="font-family: arial black,avant garde;">рпапрпр<span style="font-size: large;">прапрпарап</span></span></p>', 'ef1595632abf4d0c3620c790c5285383.jpg', '2012-08-31', '', '', '', '2012-08-31');
